CREATE TABLE `#__poll_date` (   `id` bigint(20) NOT NULL auto_increment,   `date` datetime NOT NULL default '0000-00-00 00:00:00',   `vote_id` int(11) NOT NULL default '0',   `poll_id` int(11) NOT NULL default '0',   PRIMARY KEY  (`id`),   KEY `poll_id` (`poll_id`) ) ENGINE=MyISAM DEFAULT CHARSET=latin1;
CREATE TABLE `#__poll_menu` (   `pollid` int(11) NOT NULL default '0',   `menuid` int(11) NOT NULL default '0',   PRIMARY KEY  (`pollid`,`menuid`) ) ENGINE=MyISAM DEFAULT CHARSET=latin1;
CREATE TABLE `#__polls` (   `id` int(11) unsigned NOT NULL auto_increment,   `title` varchar(100) NOT NULL default '',   `voters` int(9) NOT NULL default '0',   `checked_out` int(11) NOT NULL default '0',   `checked_out_time` datetime NOT NULL default '0000-00-00 00:00:00',   `published` tinyint(1) NOT NULL default '0',   `access` int(11) NOT NULL default '0',   `lag` int(11) NOT NULL default '0',   PRIMARY KEY  (`id`) ) ENGINE=MyISAM AUTO_INCREMENT=15 DEFAULT CHARSET=latin1;
CREATE TABLE `#__sections` (   `id` int(11) NOT NULL auto_increment,   `title` varchar(50) NOT NULL default '',   `name` varchar(255) NOT NULL default '',   `image` varchar(100) NOT NULL default '',   `scope` varchar(50) NOT NULL default '',   `image_position` varchar(10) NOT NULL default '',   `description` text NOT NULL,   `published` tinyint(1) NOT NULL default '0',   `checked_out` int(11) unsigned NOT NULL default '0',   `checked_out_time` datetime NOT NULL default '0000-00-00 00:00:00',   `ordering` int(11) NOT NULL default '0',   `access` tinyint(3) unsigned NOT NULL default '0',   `count` int(11) NOT NULL default '0',   `params` text NOT NULL,   PRIMARY KEY  (`id`),   KEY `idx_scope` (`scope`) ) ENGINE=MyISAM AUTO_INCREMENT=16 DEFAULT CHARSET=latin1;
CREATE TABLE `#__session` (   `username` varchar(50) default '',   `time` varchar(14) default '',   `session_id` varchar(200) NOT NULL default '0',   `guest` tinyint(4) default '1',   `userid` int(11) default '0',   `usertype` varchar(50) default '',   `gid` tinyint(3) unsigned NOT NULL default '0',   PRIMARY KEY  (`session_id`),   KEY `whosonline` (`guest`,`usertype`) ) ENGINE=MyISAM DEFAULT CHARSET=latin1;
CREATE TABLE `#__stats_agents` (   `agent` varchar(255) NOT NULL default '',   `type` tinyint(1) unsigned NOT NULL default '0',   `hits` int(11) unsigned NOT NULL default '1' ) ENGINE=MyISAM DEFAULT CHARSET=latin1;
CREATE TABLE `#__template_positions` (   `id` int(11) NOT NULL auto_increment,   `position` varchar(10) NOT NULL default '',   `description` varchar(255) NOT NULL default '',   PRIMARY KEY  (`id`) ) ENGINE=MyISAM AUTO_INCREMENT=28 DEFAULT CHARSET=latin1;
CREATE TABLE `#__templates_menu` (   `template` varchar(50) NOT NULL default '',   `menuid` int(11) NOT NULL default '0',   `client_id` tinyint(4) NOT NULL default '0',   PRIMARY KEY  (`template`,`menuid`) ) ENGINE=MyISAM DEFAULT CHARSET=latin1;
CREATE TABLE `#__users` (   `id` int(11) NOT NULL auto_increment,   `name` varchar(50) NOT NULL default '',   `username` varchar(25) NOT NULL default '',   `email` varchar(100) NOT NULL default '',   `password` varchar(100) NOT NULL default '',   `usertype` varchar(25) NOT NULL default '',   `block` tinyint(4) NOT NULL default '0',   `sendEmail` tinyint(4) default '0',   `gid` tinyint(3) unsigned NOT NULL default '1',   `registerDate` datetime NOT NULL default '0000-00-00 00:00:00',   `lastvisitDate` datetime NOT NULL default '0000-00-00 00:00:00',   `activation` varchar(100) NOT NULL default '',   `params` text NOT NULL,   PRIMARY KEY  (`id`),   KEY `usertype` (`usertype`),   KEY `idx_name` (`name`) ) ENGINE=MyISAM AUTO_INCREMENT=398 DEFAULT CHARSET=latin1;
CREATE TABLE `#__usertypes` (   `id` tinyint(3) unsigned NOT NULL default '0',   `name` varchar(50) NOT NULL default '',   `mask` varchar(11) NOT NULL default '',   PRIMARY KEY  (`id`) ) ENGINE=MyISAM DEFAULT CHARSET=latin1;
CREATE TABLE `#__weblinks` (   `id` int(11) unsigned NOT NULL auto_increment,   `catid` int(11) NOT NULL default '0',   `sid` int(11) NOT NULL default '0',   `title` varchar(250) NOT NULL default '',   `url` varchar(250) NOT NULL default '',   `description` varchar(250) NOT NULL default '',   `date` datetime NOT NULL default '0000-00-00 00:00:00',   `hits` int(11) NOT NULL default '0',   `published` tinyint(1) NOT NULL default '0',   `checked_out` int(11) NOT NULL default '0',   `checked_out_time` datetime NOT NULL default '0000-00-00 00:00:00',   `ordering` int(11) NOT NULL default '0',   `archived` tinyint(1) NOT NULL default '0',   `approved` tinyint(1) NOT NULL default '1',   `params` text NOT NULL,   PRIMARY KEY  (`id`),   KEY `catid` (`catid`,`published`,`archived`) ) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;
CREATE TABLE `#__xegallerypro` (   `id` int(11) NOT NULL auto_increment,   `catid` int(11) NOT NULL default '0',   `imgtitle` text NOT NULL,   `imgauthor` varchar(50) default NULL,   `imgtext` text NOT NULL,   `imgdate` varchar(20) default NULL,   `imgcounter` int(11) NOT NULL default '0',   `imgvotes` int(11) NOT NULL default '0',   `imgvotesum` int(11) NOT NULL default '0',   `published` tinyint(1) NOT NULL default '1',   `imgfilename` varchar(50) NOT NULL default '',   `imgthumbname` varchar(50) NOT NULL default '',   `ordering` int(11) NOT NULL default '0',   `checked_out` int(11) NOT NULL default '0',   `owner` varchar(50) NOT NULL default '',   `approved` int(1) NOT NULL default '0',   `useruploaded` int(1) NOT NULL default '0',   PRIMARY KEY  (`id`) ) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;
CREATE TABLE `#__xegallerypro_catg` (   `cid` int(11) NOT NULL auto_increment,   `name` varchar(255) NOT NULL default '',   `parent` varchar(255) NOT NULL default '0',   `description` text,   `ordering` int(11) NOT NULL default '0',   `access` tinyint(3) unsigned NOT NULL default '0',   `published` char(1) NOT NULL default '1',   PRIMARY KEY  (`cid`) ) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;
CREATE TABLE `#__zoom` (   `catid` int(11) NOT NULL auto_increment,   `catname` varchar(50) default '0',   `catdescr` varchar(255) default NULL,   `catdir` varchar(50) default '0',   `catimg` int(11) default NULL,   `catpassword` varchar(100) NOT NULL default '',   `catkeywords` varchar(240) NOT NULL default '',   `subcat_id` int(11) NOT NULL default '0',   `pos` int(3) NOT NULL default '0',   `hideMsg` tinyint(1) NOT NULL default '0',   `shared` tinyint(1) NOT NULL default '0',   `published` tinyint(1) NOT NULL default '1',   `uid` int(11) NOT NULL default '0',   `catmembers` varchar(240) NOT NULL default '',   PRIMARY KEY  (`catid`),   KEY `catdir_search` (`catdir`),   KEY `rel_subcats` (`subcat_id`) ) ENGINE=MyISAM AUTO_INCREMENT=117 DEFAULT CHARSET=latin1;
CREATE TABLE `#__zoom_comments` (   `cmtid` int(11) NOT NULL auto_increment,   `imgid` int(11) NOT NULL default '0',   `cmtname` varchar(40) NOT NULL default '',   `cmtcontent` text NOT NULL,   `cmtdate` timestamp NOT NULL default CURRENT_TIMESTAMP on update CURRENT_TIMESTAMP,   PRIMARY KEY  (`cmtid`),   KEY `imgid` (`imgid`) ) ENGINE=MyISAM AUTO_INCREMENT=5013 DEFAULT CHARSET=latin1;
