INSERT INTO `bak_content` VALUES ('5', 'Joomla! License Guidelines', '', '<p>This website is powered by <a href=\"http://www.joomla.org/\">Joomla!</a>  The software and default templates on which it runs are Copyright 2005 <a href=\"http://www.opensourcematters.org/\">Open Source Matters</a>.  All other content and data, including data entered into this website and templates added after installation, are copyrighted by their respective copyright owners.</p><p>If you want to distribute, copy or modify Joomla!, you are welcome to do so under the terms of the <a href=\"http://www.gnu.org/copyleft/gpl.html#SEC1\">GNU General Public License</a>.  If you are unfamiliar with this license, you might want to read <a href=\"http://www.gnu.org/copyleft/gpl.html#SEC4\">\'How To Apply These Terms To Your Program\'</a> and the <a href=\"http://www.gnu.org/licenses/gpl-faq.html\">\'GNU General Public License FAQ\'</a>.</p>', '', '1', '0', '0', '0', '2004-08-19 20:11:07', '62', '', '2004-08-19 20:14:49', '62', '0', '0000-00-00 00:00:00', '2004-08-19 00:00:00', '0000-00-00 00:00:00', '', '', 'menu_image=\nitem_title=1\npageclass_sfx=\nback_button=\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=', '1', '0', '11', '', '', '0', '10');
