INSERT INTO `#__content` VALUES ('1', 'Calendrio Letivo', 'Escola Oficina dos Sonhos', '<p align=\"center\">&nbsp;&nbsp;{mosimage}</p><p align=\"justify\">&Oacute; Deus, que te fizeste crian&ccedil;a para que, na tua fragilidade, melhor te am&aacute;ssemos e mais facilmente pud&eacute;ssemos adorar a tua onipot&ecirc;ncia.<br />Aben&ccedil;oa esta fam&iacute;lia reunida, em esp&iacute;rito de humildade e alegria, ao redor da mesa festiva desta ceia natal&iacute;cia, e faz descer sobre o mundo a luz da paz, aquela que, nesta noite santa, os anjos prometeram &agrave;s pessoas de boa vontade: gl&oacute;ria a Deus no mais alto dos c&eacute;us, e, na terra, paz aos que s&atilde;o do seu agrado! (Lc 2,14)</p><p align=\"center\">{mosimage}</p>', '', '1', '1', '0', '1', '2004-06-12 11:54:06', '62', 'Web Master', '2006-06-05 11:55:34', '62', '0', '0000-00-00 00:00:00', '2004-01-01 00:00:00', '0000-00-00 00:00:00', 'calendario.jpg|center||0||bottom|center|\r\nimg_escola/predio_oficina.jpg|center||0||bottom||', '', 'pageclass_sfx=\nback_button=\nitem_title=0\nlink_titles=0\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '14', '0', '61', '', '', '0', '157');
