INSERT INTO `#__content` VALUES ('12', 'Palavra da Direo', '', '{mosimage} <blockquote><p align=\"justify\"><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">A Escola Oficina dos Sonhos, al&eacute;m de transmitir aos alunos, os conte&uacute;dos necess&aacute;rios ao crescimento intelectual, quer ensinar a amar a vida, superar conflitos e ser solid&aacute;rio. Amar &eacute; a necessidade universal mais sublime e mais dif&iacute;cil de ser atendida. O mestre dos mestres fornecia regras e ensinamentos, queria conduzir o homem a ser um caminhante na trajet&oacute;ria do seu pr&oacute;prio ser.</span></p></blockquote>', '<blockquote><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">O papel da Escola &eacute; ensinar a pensar, a enfrentar os desafios internos e externos, a fazer do ato de viver a grande oportunidade para a amplia&ccedil;&atilde;o de subs&iacute;dios na investiga&ccedil;&atilde;o da pr&oacute;pria realidade. S&oacute; assim uma transforma&ccedil;&atilde;o ter&aacute; &ecirc;xito e permitir&aacute; que cada indiv&iacute;duo contribua para o resgate e cultivo consciente dos valores morais e espirituais, esfor&ccedil;ando-se para moldar um novo modelo de sociedade. Os valores morais e espirituais fazem aflorar o conhecimento interior, o despertar da alma e o aperfei&ccedil;oamento do car&aacute;ter.</span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"> <p align=\"justify\">Propomos um aprendizado integral, em que a proposta curricular &aacute; aplicada de maneira abrangente, rica e experimentada conjuntamente pela internaliza&ccedil;&atilde;o dos valores.</p><p align=\"justify\">Precisamos estimular os jovens a pensar, ter sutileza, perspic&aacute;cia, seguran&ccedil;a e ousadia e acima de tudo formar pensadores que conhe&ccedil;am o alfabeto do amor.</p><p align=\"justify\">&quot;<strong>O cora&ccedil;&atilde;o do s&aacute;bio adquire o conhecimento, e o ouvido dos s&aacute;bios procura o saber&quot;</strong> Pv18:15</p><p align=\"justify\">Marcia Poletti - Diretora</p></span></blockquote>', '1', '6', '0', '18', '2006-05-24 00:28:25', '68', '', '2008-04-10 09:12:03', '68', '0', '0000-00-00 00:00:00', '2006-05-24 00:27:56', '0000-00-00 00:00:00', 'barra.jpg|center||0||bottom||', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '25', '0', '4', '', '', '0', '1018');
INSERT INTO `#__content` VALUES ('13', 'Histrico', '', '<html>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=iso-8859-1\">\r\n<style type=\"text/css\">\r\n<!--\r\n.style1 {\r\n	font-family: \"Trebuchet MS\";\r\n	font-size: 12px;\r\n}\r\n-->\r\n</style>\r\n</head>\r\n\r\n<body>\r\n<p align=\"center\"><strong>CENTRO DE EDUCA&Ccedil;&Atilde;O OFICINA DOS SONHOS</strong></p>\r\n<p align=\"justify\" class=\"style1\">A Escola Oficina foi fundada em 12 de dezembro de 1996.<br />\r\nSituada na Rua Hermann, lange, 270  Costa e Silva.<br />\r\nIniciamos as atividades curriculares em dezembro de 1996 com apenas 12 crian&ccedil;as, 01 zeladora, 01 auxiliar e M&aacute;rcia Poletti como professora.<br />\r\nEm menos de 01 ano t&iacute;nhamos 50 alunos, contratamos mais profissionais, ampliamos o espa&ccedil;o no pr&oacute;prio terreno, sempre priorizando qualidade na Educa&ccedil;&atilde;o.<br />\r\nMais tarde compramos um terreno na Rua Senador Nilo Coelho, 181, pois na escolinha onde tudo come&ccedil;ou faltava espa&ccedil;o.<br />\r\nEm Fevereiro de 2001 mudamos para a nossa escola, t&iacute;nhamos conseguido adquirir uma sede pr&oacute;pria...Quanta Felicidade!!!!<br />\r\nHoje com 270 alunos a Escola nova que em 2001 era o ideal, tornou-se pequena, o espa&ccedil;o ficou limitado aos nossos objetivos.<br />\r\nEm 2003 come&ccedil;amos a procurar um terreno para uma futura amplia&ccedil;&atilde;o com uma constru&ccedil;&atilde;o moderna, para atender melhor os alunos.<br />\r\nO crescimento positivo desta institui&ccedil;&atilde;o, apoiado pela confian&ccedil;a da comunidade e em Deus, baseado na sua Palavra, continua ano ap&oacute;s ano.<br />\r\nHoje estamos em obras onde, teremos 14.000 metros quadrados de &aacute;rea verde, com direito a trilhas, nascente, salas amplas, laborat&oacute;rios, quadras polivalentes....<br />\r\nPodemos falar com o cora&ccedil;&atilde;o cheio de bons sentimentos, que toda esta trajet&oacute;ria valeu e que queremos mais do que ensinar os PCN\'s, mas mudar os pilares centrais que estruturam a personalidade, aprender a pensar antes de reagir e amar o espet&aacute;culo da vida.<br />\r\nAs sementes que plantamos, precisam ser regadas com muito Amor.<br />\r\nPrecisamos seguir o caminho do Mestre dos Mestres...<br />\r\nTemos a certeza que podemos fazer de nossos alunos, verdadeiros governadores deste pa&iacute;s.<br />\r\nO princ&iacute;pio de semeadura e colheita se aplica para implantarmos a Verdade de Deus nas na&ccedil;&otilde;es. &Eacute; num processo gradual, atrav&eacute;s da Educa&ccedil;&atilde;o Crist&atilde;, que as sementes s&atilde;o plantadas e cuidadas, para produzir frutos em todos os aspectos da vida: pessoal, social, pol&iacute;tica e econ&ocirc;mica.<br />\r\n</p>\r\n<p align=\"left\" class=\"style1\"> M&aacute;rcia Poletti </p>\r\n<div align=\"left\" class=\"style1\">Diretora</div>\r\n</body>\r\n</html>\r\n', '', '1', '6', '0', '18', '2006-05-24 00:28:45', '62', '', '2006-06-12 18:16:14', '62', '0', '0000-00-00 00:00:00', '2006-05-24 00:28:30', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '2', '0', '5', '', '', '0', '603');
INSERT INTO `#__content` VALUES ('14', 'Princpios e Valores', '', '<blockquote><p align=\"justify\"><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">Num tempo em que a apar&ecirc;ncia vale mais do que a ess&ecirc;ncia e a competi&ccedil;&atilde;o imperam nos relacionamentos, &eacute; imprescind&iacute;vel falar com nossas crian&ccedil;as de companheirismo, amizade e amor. Num tempo em que a esperan&ccedil;a parece cada vez mais escassa, &eacute; fundamental reavivar nossa confian&ccedil;a em dias melhores. Num tempo em que valores devem nortear a vida em sociedade e est&atilde;o esquecidos.</span></p></blockquote>', '<blockquote><p align=\"justify\"><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">A Escola Oficina dos Sonhos optou por incluir em nosso curr&iacute;culo Educa&ccedil;&atilde;o por Princ&iacute;pios, em busca de resgatar a ess&ecirc;ncia da VIDA.<br />O que &eacute; Educa&ccedil;&atilde;o por Princ&iacute;pios?&nbsp;&Eacute; um m&eacute;todo educacional crist&atilde;o que desenvolve o racioc&iacute;nio a partir dos fundamentos b&iacute;blicos, que est&aacute; baseado em quatro passos: Pesquisar, Raciocinar, Relacionar e Registrar.<br />O Centro de Educa&ccedil;&atilde;o Oficina dos Sonhos agradece a Deus e recebe com alegria e gratid&atilde;o cada crian&ccedil;a e fam&iacute;lia no desejo de servi-los sempre com amor.</p></span></blockquote>', '1', '6', '0', '18', '2006-05-24 00:29:03', '62', '', '2006-07-30 11:31:08', '63', '0', '0000-00-00 00:00:00', '2006-05-24 00:28:49', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '6', '', '', '0', '706');
INSERT INTO `#__content` VALUES ('47', 'Violo', '', '<p>A aula de viol&atilde;o possibilita conhecer as notas musicais, ler e identificar partituras, tocar e cantar ao som do viol&atilde;o. As aulas s&atilde;o realizadas individualmente ou em pequenos grupos divido por faixa et&aacute;ria. </p><p><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=44\">CONFIRA AS FOTOS...</a></p><p align=\"center\">{mosimage}</p>', '<p align=\"center\">&nbsp;</p>', '1', '11', '0', '22', '2006-08-09 01:30:27', '68', '', '2008-04-10 09:16:48', '68', '0', '0000-00-00 00:00:00', '2006-08-09 01:30:00', '0000-00-00 00:00:00', 'violao ana.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '25', '0', '7', '', '', '0', '622');
INSERT INTO `#__content` VALUES ('46', 'Transporte Escolar', '', '<p align=\"center\">{mosimage}</p>\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<head>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=iso-8859-1\" />\r\n<title>Untitled Document</title>\r\n<style type=\"text/css\">\r\n<!--\r\n.style1 {\r\n	color: #FF0000;\r\n	font-size: 18px;\r\n	font-weight: bold;\r\n}\r\n-->\r\n</style>\r\n</head>\r\n\r\n<body>\r\n<div align=\"center\"><span class=\"style1\">Adriano e Tere 3453-1280 / 9129-4404<br />\r\n  Juliano 3466-4994 / 8812-2729<br />\r\nDin&aacute;vio 3473-7257 / 8822-8855 / 9994-2392</span></div>\r\n</body>\r\n</html>', '', '1', '15', '0', '33', '2006-07-30 12:26:20', '63', '', '2006-07-30 12:36:54', '63', '0', '0000-00-00 00:00:00', '2006-07-30 12:23:28', '0000-00-00 00:00:00', 'foto1.jpg|center||0||bottom||', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '8', '0', '3', '', '', '0', '393');
INSERT INTO `#__content` VALUES ('16', 'Para Refletir', '', '<span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><strong>Os Princ&iacute;pios b&iacute;blicos aplicados na vida do estudante:</strong></span>', '<p align=\"justify\"><span style=\"font-size: 10pt; color: black; font-family: &#39;Trebuchet MS&#39;\"><strong>Individualidade</strong> </span><span style=\"font-weight: normal; font-size: 10pt; color: black; font-family: &#39;Trebuchet MS&#39;\">Cada um tem a sua forma de aprender e de expressar o que sabe. Voc&ecirc; tem muito a aprender e muito a ensinar. Lembre-se, sua atitude tamb&eacute;m &eacute; uma maneira de ensinar as pessoas. Respeite e contribua!</span></p><p align=\"justify\"><span style=\"font-size: 10pt; color: black; font-family: &#39;Trebuchet MS&#39;\"><strong>Semear e colher</strong> </span><span style=\"font-weight: normal; font-size: 10pt; color: black; font-family: &#39;Trebuchet MS&#39;\">Tenha compromisso com seus estudos, seja respons&aacute;vel, enrique&ccedil;a seu aprendizado pesquisando e estudando al&eacute;m do que &eacute; ensinado em sala de aula, assim seu sucesso ser&aacute; uma realidade.</span></p><p align=\"justify\"><span style=\"font-size: 10pt; color: black; font-family: &#39;Trebuchet MS&#39;\"><strong>Autogoverno</strong> </span><span style=\"font-weight: normal; font-size: 10pt; color: black; font-family: &#39;Trebuchet MS&#39;\">Procure se controlar diante de situa&ccedil;&otilde;es que queiram tirar sua aten&ccedil;&atilde;o e concentra&ccedil;&atilde;o das atividades escolares. Isto serve para sala de aula e em casa, nas horas separadas para estudos.</span></p><p align=\"justify\"><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><span style=\"font-family: &#39;Trebuchet MS&#39;\"><strong>Uni&atilde;o </strong></span>Todas as pessoas que fazem parte do seu contexto escolar s&atilde;o importantes na sua forma&ccedil;&atilde;o: colegas, professores, funcion&aacute;rios, etc., portanto, procure ser amigo dessas pessoas, valorizando-as e respeitando-as.</span><span>Car&aacute;ter <span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">Seja sempre honesto, primeiramente consigo mesmo, cumprindo suas tarefas com a impedir seu crescimento e o de seus colegas. Fa&ccedil;a diferen&ccedil;a onde est&aacute; plantado!</span></span></p><p align=\"justify\"><span style=\"font-size: 10pt; color: black; font-family: &#39;Trebuchet MS&#39;\"><strong>Mordomia</strong> </span><span style=\"font-weight: normal; font-size: 10pt; color: black; font-family: &#39;Trebuchet MS&#39;\">Cuide de aprender o que est&aacute; sendo ensinado HOJE. N&atilde;o perca a oportunidade de crescer com as pessoas que Deus colocou no seu caminho.</span></p><p align=\"justify\"><span style=\"font-size: 10pt; color: black; font-family: &#39;Trebuchet MS&#39;\"><strong>Soberania</strong> </span><span style=\"font-weight: normal; font-size: 10pt; color: black; font-family: &#39;Trebuchet MS&#39;\">Creia que voc&ecirc; jamais estaria aqui, neste Col&eacute;gio, se Deus assim n&atilde;o o quisesse, ent&atilde;o confia Nele e agrade&ccedil;o-O, pois Ele pode aben&ccedil;o&aacute;-lo muito com todas as coisas que lhe s&atilde;o oferecidas neste momento: professores, funcion&aacute;rios, estrutura da escola, material pedag&oacute;gico, metodologia...</span><span style=\"font-weight: normal; font-size: 10pt; color: black; font-family: &#39;Trebuchet MS&#39;\">&nbsp;</span></p>', '1', '9', '0', '19', '2006-05-24 01:38:41', '62', '', '2006-05-24 01:47:15', '62', '0', '0000-00-00 00:00:00', '2006-05-24 01:36:22', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '5', '0', '3', '', '', '0', '371');
