INSERT INTO `#__content` VALUES ('20', 'Projetos2', '', 'Veja Abaixo a rela&ccedil;&atilde;o completa de nossos projetos para seu filho!', '<p style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\" align=\"justify\"><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Projeto de Leitura</font></span></strong></p>&nbsp;<span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">A Hist&oacute;ria &eacute; um momento em que a crian&ccedil;a come&ccedil;a a estabelecer rela&ccedil;&otilde;es desenvolvendo a sua forma de pensar. &nbsp;</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Tornar a leitura um h&aacute;bito em sala de aula, realizando atividades que despertem o interesse e a criatividade das crian&ccedil;as e principalmente oportunizando agrad&aacute;veis momentos de leitura s&atilde;o os principais objetivos deste projeto.</font></span><font color=\"#000000\"><span style=\"font-size: 10pt; font-family: Wingdings\"><span>&Oslash;<span style=\"font: 7pt &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">Despertar o interesse de ouvir e recontar hist&oacute;rias;</span></font><font color=\"#000000\"><span style=\"font-size: 10pt; font-family: Wingdings\"><span>&Oslash;<span style=\"font: 7pt &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">Transformar o momento da leitura num momento de descontra&ccedil;&atilde;o;</span></font><font color=\"#000000\"><span style=\"font-size: 10pt; font-family: Wingdings\"><span>&Oslash;<span style=\"font: 7pt &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">Conhecer diversos tipos de hist&oacute;rias e autores;</span></font><font color=\"#000000\"><span style=\"font-size: 10pt; font-family: Wingdings\"><span>&Oslash;<span style=\"font: 7pt &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">Oportunizar atividades que possibilitem as crian&ccedil;as relatarem oralmente ou atrav&eacute;s de registros diversos.</span></font><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></font></span></strong><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span></strong><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span></strong><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Projeto Brinquedoteca e Recicloteca</font></span></strong>&nbsp;<span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">O que &eacute; espa&ccedil;o l&uacute;dico ou seja, Brinquedoteca? </font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Qual a import&acirc;ncia para o desenvolvimento de nossas crian&ccedil;as?</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&ldquo;Brinquedoteca &eacute; um espa&ccedil;o preparado para estimular a crian&ccedil;a a brincar, possibilitando o acesso a uma grande variedade de brinquedos, dentro de um ambiente especialmente l&uacute;dico. &Eacute; um lugar onde tudo convida a explorar, a sentir e a experimentar. </font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Os brinquedos favorecem a aprendizagem de todas as crian&ccedil;as e possibilitam experi&ecirc;ncias concretas. </font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&ldquo;O brinquedo favorece a express&atilde;o da crian&ccedil;a, envolve-a no brincar, valoriza a afetividade, cultiva a sensibilidade e oportuniza a criatividade&rdquo;.</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span></strong> <p style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\" align=\"justify\"><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Projeto Educa&ccedil;&atilde;o Crist&atilde;</font></span></strong></p>&nbsp;<span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">O Projeto Educa&ccedil;&atilde;o Crist&atilde; tem por princ&iacute;pios resgatar valores que est&atilde;o sendo distintos de nossa sociedade como: amor ao pr&oacute;ximo, respeito aos mais velhos, companheirismo, uni&atilde;o... Com base em hist&oacute;rias, m&uacute;sicas, que estejam relacionados aos conceitos b&iacute;blicos.</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Projeto de Educa&ccedil;&atilde;o Ambiental</font></span></strong><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span></strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">A Educa&ccedil;&atilde;o Ambiental restringe-se em trabalhar assuntos relacionados &agrave; natureza: lixo, preserva&ccedil;&atilde;o, paisagens naturais, animais... </font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Dentro deste enfoque, a Educa&ccedil;&atilde;o Ambiental assume um car&aacute;ter basicamente naturalista.</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">A horta escolar possibilita as crian&ccedil;as a mexerem na terra, plantar, observar, pegar <span>minhocas</span> e, ainda, degustar o produto da Horta.</font></span><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span></strong><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span></strong><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Projeto Teatro na Escola</font></span></strong><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span></strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">No projeto de Teatro buscamos envolver as crian&ccedil;as em diversas atividades, aprimorando a criatividade, desenvoltura, express&atilde;o corporal, comunica&ccedil;&atilde;o e seguran&ccedil;a pessoal. </font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">O trabalho desenvolvido procura explorar o l&uacute;dico, a magia do faz-de-conta e das hist&oacute;rias infantis. &Eacute; atrav&eacute;s das encena&ccedil;&otilde;es, dramatiza&ccedil;&otilde;es que as crian&ccedil;as s&atilde;o levadas a explorar sua potencialidades e descobrir suas habilidades.</font></span><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span></strong><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span></strong> <p style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\" align=\"justify\"><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Projeto de M&uacute;sica</font></span></strong></p>&nbsp;<span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Objetivo Geral: Demonstrar o valor construtivo da m&uacute;sica na Educa&ccedil;&atilde;o Infantil.</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Objetivos Espec&iacute;ficos:&nbsp;</font></span> <ol style=\"margin-top: 0cm\"><li class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; tab-stops: list 36.0pt\"><div align=\"justify\"><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">Restabelecer a rela&ccedil;&atilde;o da m&uacute;sica com a constru&ccedil;&atilde;o do conhecimento.</span></div></li><li class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; tab-stops: list 36.0pt\"><div align=\"justify\"><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">Estimular na crian&ccedil;a a capacidade de percep&ccedil;&atilde;o, sensibilidade, imagina&ccedil;&atilde;o, cria&ccedil;&atilde;o, bem como age como uma recrea&ccedil;&atilde;o educativa, sociabilizando, disciplinando e desenvolvendo a sua aten&ccedil;&atilde;o.</span></div></li></ol><p align=\"justify\"><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">Desenvolver diversas habilidades ligadas tanto &agrave;s &aacute;reas motoras, cognitivas e afetivas, promovendo a forma&ccedil;&atilde;o integral das crian&ccedil;as.</span></p>', '0', '8', '0', '20', '2006-05-24 01:57:59', '68', '', '2008-06-26 17:58:45', '68', '0', '0000-00-00 00:00:00', '2006-05-24 01:55:48', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '6', '0', '4', '', '', '0', '307');
INSERT INTO `#__content` VALUES ('17', 'Fotos', 'Uma aula divertida!', '<p>Para melhor explorar&nbsp;o conte&uacute;do visto na aula de Ci&ecirc;ncias, a&nbsp;&nbsp;turma da 6&ordf; s&eacute;rie&nbsp;viu na pr&aacute;tica todas as partes de um peixe. Foi emplogante!!!</p><p>Confira!</p>', '', '1', '9', '0', '19', '2006-05-24 01:44:26', '62', '', '2006-10-20 18:40:05', '68', '0', '0000-00-00 00:00:00', '2006-05-24 01:44:07', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '7', '', '', '0', '103');
INSERT INTO `#__content` VALUES ('18', 'Proposta Pedaggica', '', '<p align=\"justify\"><font color=\"#000000\"><span class=\"texto1\"><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">O Centro de Educa&ccedil;&atilde;o Oficina dos Sonhos tem como proposta uma educa&ccedil;&atilde;o que contemple a forma&ccedil;&atilde;o do aluno atrav&eacute;s do desenvolvimento cognitivo, f&iacute;sico, afetivo e social. Contudo, educa&ccedil;&atilde;o n&atilde;o &eacute; apenas o processo de transferir conte&uacute;dos acad&ecirc;micos, mas todo conjunto de instru&ccedil;&otilde;es, disciplinas e pr&aacute;ticas que visam preparar esta gera&ccedil;&atilde;o para cumprir plenamente sua voca&ccedil;&atilde;o e o seu papel na sociedade, fundamentada </span></span><span class=\"texto1\"><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">em uma Educa&ccedil;&atilde;o</span></span><span class=\"texto1\"><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"> Crist&atilde;.</span></span><span style=\"font-size: 10pt; color: black; font-family: &#39;Trebuchet MS&#39;\"> Por isso, nos empenhamos tanto em construir conhecimentos, quanto em ensinar valores que s&atilde;o a base para que, no futuro, o aluno seja um adulto feliz, capacitado e consciente.</span></font></p>', '<p align=\"justify\"><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">O Ensino Fundamental &eacute; uma continuidade do trabalho realizado na Educa&ccedil;&atilde;o Infantil. A a&ccedil;&atilde;o pedag&oacute;gica continua se desenvolvendo atrav&eacute;s do equil&iacute;brio entre os interesses do aluno e a interven&ccedil;&atilde;o do trabalho do professor, cujo objetivo &eacute; o desenvolvimento de uma postura cr&iacute;tica e participativa, incentivando o gosto pelas descobertas e a valoriza&ccedil;&atilde;o das experi&ecirc;ncias individuais e coletivas. </font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Todo o trabalho tem o objetivo de desenvolver o racioc&iacute;nio criativo, construir o conhecimento atrav&eacute;s de pesquisa e fundamentar o aprendizado na aplica&ccedil;&atilde;o de Princ&iacute;pios B&iacute;blicos.</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">Temos a certeza de que o exemplo &eacute; uma ferramenta fundamental no processo do ensino e aprendizagem.</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">N&atilde;o basta ensinar o caminho; &eacute; preciso ensinar no caminho.</font></span><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span></p>\r\n<p align=\"justify\"><font color=\"#000000\"><em><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">&quot;Ensina a crian&ccedil;a no caminho em </span></strong></em><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">que deve </span></strong><em><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">andar e ainda quando for velho </span></strong></em><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">n&atilde;o </span></strong><em><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">se desviar&aacute; dele&quot; Prov&eacute;rbios </span></strong></em><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">22:6</span></strong></font></p><p align=\"justify\"><font color=\"#000000\"></font><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">&nbsp;</font></span></strong><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\"><font color=\"#000000\">F&aacute;bia S. Poffo</font></span></strong></p><p align=\"justify\"><strong><span style=\"font-size: 10pt; font-family: &#39;Trebuchet MS&#39;\">Coordena&ccedil;&atilde;o Pedag&oacute;gica</span></strong></p>', '1', '9', '0', '19', '2006-05-24 01:46:05', '62', '', '2006-08-28 22:42:10', '63', '0', '0000-00-00 00:00:00', '2006-05-24 01:44:41', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '5', '', '', '0', '618');
INSERT INTO `#__content` VALUES ('24', 'Ballet', '', '<p align=\"justify\">O Ballet tem o objetivo de proporcionar atividades f&iacute;sicas alegres, partindo do l&uacute;dico, desenvolvendo a coordena&ccedil;&atilde;o motora ampla, a musicalidade, o ritmo, o trabalho em grupo, e os movimentos b&aacute;sicos do ballet cl&aacute;ssico.</p><p align=\"center\">{mosimage}</p>', '<div align=\"justify\"><p class=\"texto\"><br />Durante as aulas ocorrem alongamentos, aquecimento, trabalho de barra, coreografias e relaxamento. As aulas s&atilde;o realizadas em grupos de crian&ccedil;as divididos por faixa et&aacute;ria. A Professora Cristiane Atila Brenny ministra as aulas na Escola Oficina dos Sonhos, facilitando a locomo&ccedil;&atilde;o das crian&ccedil;as. <a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=37\">Veja&nbsp; as fotos!!</a></p><p class=\"texto\">&nbsp;</p><table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"200\" height=\"143\" align=\"center\"><tbody><tr><td background=\"imagens/fundo_azul.jpg\" scope=\"col\"><table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"190\" align=\"center\"><tbody><tr><td colspan=\"2\" align=\"center\"><div align=\"center\"><strong>Ballet</strong></div></td></tr><tr><td width=\"150\" align=\"center\"><div align=\"center\"><strong>Dia</strong></div></td><td width=\"150\" align=\"center\"><div align=\"center\"><strong>Hor&aacute;rio</strong></div></td></tr><tr><td align=\"center\"><div align=\"center\">4a e 6a feira</div></td><td align=\"center\"><div align=\"center\">15h&nbsp;&agrave;s 15h45min</div></td></tr><tr><td colspan=\"2\" align=\"center\"><div align=\"center\"><p>&nbsp;</p></div></td></tr></tbody></table></td></tr></tbody></table><p class=\"texto\" align=\"center\"><br /></p></div>', '1', '11', '0', '22', '2006-05-24 10:28:35', '68', '', '2008-04-10 09:16:38', '68', '0', '0000-00-00 00:00:00', '2006-05-24 10:22:28', '0000-00-00 00:00:00', 'foto aulas extras.jpg', '', 'pageclass_sfx=\nb