INSERT INTO `#__content` VALUES ('109', 'Visita do Prefeito na Oficina...', '', '<p>{mosimage}No dia 28 de Mar&ccedil;o recebemos a visita </p><p>do Prefeito Marco Tebaldi em nossa Escola. </p><p>Atrav&eacute;s do Projeto ambiental, os alunos solicitaram ao </p><p>Prefeito placas para conscientizar a comunidade...Confira!!!</p>', '', '1', '1', '0', '1', '2007-03-28 14:35:10', '84', '', '2007-03-28 15:15:04', '84', '0', '0000-00-00 00:00:00', '2007-03-28 14:29:17', '0000-00-00 00:00:00', 'dsc03858.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '3', '0', '37', '', '', '0', '99');
INSERT INTO `#__content` VALUES ('33', 'Indicao de Leitura', '', '<html>\r\n<head>\r\n\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=iso-8859-1\">\r\n<style type=\"text/css\">\r\n<!--\r\n\r\n.style3 {font-family: \"Trebuchet MS\"}\r\n-->\r\n</style>\r\n</head>\r\n<body>\r\n<p class=\"style3\"><strong>Livros: </strong></p>\r\n<p class=\"style3\">Disciplina:Limite na medida certa (I&ccedil;ami Tiba) </p>\r\n<p class=\"style3\">Mensagens de Deus para garotos - Devocional </p>\r\n<span class=\"style3\">Mensagens de Deus para garotas\r\n</span>\r\n<p align=\"center\"><span class=\"style2\"></span>\r\n</p>\r\n<p align=\"center\" class=\"style1\">&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', '1', '9', '0', '19', '2006-06-12 18:28:42', '62', '', '0000-00-00 00:00:00', '0', '0', '0000-00-00 00:00:00', '2006-06-12 18:27:45', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '1', '0', '4', '', '', '0', '245');
INSERT INTO `#__content` VALUES ('34', 'Coordenao Pedaggica', '', '<p class=\"style3\" align=\"center\">A Coordena&ccedil;&atilde;o Pedag&oacute;gica tem por finalidade ajudar a elaborar e aplicar o projeto da escola, dar orienta&ccedil;&atilde;o em quest&otilde;es pedag&oacute;gicas e principalmente dar assist&ecirc;ncia aos professores, alunos e pais, de forma individual ou em grupo, buscando por um melhor desenvolvimento e aprendizado. Objetiva tamb&eacute;m garantir a unidade e a continuidade da a&ccedil;&atilde;o educativa, atuando antes, durante e ap&oacute;s o processo de aprendizagem, em todos os n&iacute;veis de sua compet&ecirc;ncia. </p><div align=\"center\"><span class=\"style5\">Desenvolve atividades que promovam atitudes positivas necess&aacute;rias ao conv&iacute;vio social e a melhoria da vida escolar. </span></div><p class=\"style3\"><span class=\"style3\"><br /></span></p><p class=\"style3\">&nbsp;</p><p align=\"center\">&nbsp;</p><p class=\"style1\" align=\"center\">&nbsp;</p>', '', '1', '14', '0', '24', '2006-06-12 18:39:06', '68', '', '2008-03-26 16:54:48', '68', '0', '0000-00-00 00:00:00', '2006-06-12 18:37:59', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '3', '0', '1', '', '', '0', '103');
INSERT INTO `#__content` VALUES ('128', '16 Festival de Dana Interescolar', '', '<p>{mosimage}Neste &uacute;ltimo de 24 de Outubro o Grupo de Jazz da Oficina participou no&nbsp; Festival de Dan&ccedil;a Interescolar.</p><p>Parab&eacute;ns alunas!!! Voc&ecirc;s arrasaram e garatiram o 3&ordm; lugar. <a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=82\">Confira as fotos!!!</a></p>', '', '1', '1', '0', '1', '2007-10-25 10:19:35', '68', '', '2007-10-25 12:05:47', '68', '0', '0000-00-00 00:00:00', '2007-10-25 10:16:49', '0000-00-00 00:00:00', 'chamadinha jazz.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '6', '0', '20', '', '', '0', '178');
