INSERT INTO `#__content` VALUES ('68', '15 Festival Escolar de Dana', '', '<p>{mosimage}</p><p>Nosso Grupo de Jazz participou dia&nbsp;24&nbsp;de outubro do 15&ordm; Festival Escolar de Dan&ccedil;a&nbsp;e arrassou.</p><p>Parab&eacute;ns meninas&nbsp;voc&ecirc;s estavam lindas!!! </p><p>A Oficina dos Sonhos agradece a&nbsp;todas pela empenho e dedica&ccedil;&atilde;o.</p><p><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=32\">Confira!!!</a></p>', '', '0', '1', '0', '1', '2006-10-20 16:51:57', '84', '', '2007-10-24 16:34:10', '68', '0', '0000-00-00 00:00:00', '2006-10-20 16:40:14', '0000-00-00 00:00:00', 'chamada jazz.jpg|||0||bottom||', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '5', '0', '51', '', '', '0', '41');
INSERT INTO `#__content` VALUES ('70', 'Visita Caverna de Botuver...', '', '<strong><font size=\"3\"><font color=\"#000000\"><font face=\"Times New Roman\">{mosimage}Visita nas Grutas de Botuver&aacute; e no Observat&oacute;rio de Brusque</font></font></font></strong> <p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\"><font face=\"Times New Roman\" size=\"3\" color=\"#000000\">A turma da 5&ordf; s&eacute;rie foi a uma viagem de estudos, &ldquo;uma aventura&rdquo;; como relatou o grupo animado.</font></p><p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\"><font face=\"Times New Roman\" size=\"3\" color=\"#000000\">As grutas possibilitaram a visualiza&ccedil;&atilde;o de conte&uacute;dos trabalhados em sala<span>&nbsp; </span>e que s&atilde;o pouco comuns no dia-a-dia.</font></p><p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\"><font face=\"Times New Roman\" size=\"3\" color=\"#000000\">O Observat&oacute;rio situado em Brusque promoveu o enriquecimento dos conte&uacute;dos de Ci&ecirc;ncias como o Sistema Solar.</font></p><strong><font size=\"3\"><font color=\"#000000\"><font face=\"Times New Roman\">Dicas de lugares sensacionais para vivenciar grandes experi&ecirc;ncias. <a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=34\">Confira!!!</a>&nbsp;</font></font></font></strong>', '', '1', '1', '0', '1', '2006-10-20 18:48:55', '68', '', '2006-10-20 19:20:45', '68', '0', '0000-00-00 00:00:00', '2006-10-20 18:45:07', '0000-00-00 00:00:00', 'chamada caverna.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '2', '0', '49', '', '', '0', '113');
INSERT INTO `#__content` VALUES ('25', 'Natao', '', '<div align=\"center\">{mosimage}</div><div align=\"justify\">A nata&ccedil;&atilde;o tem in&uacute;meros benef&iacute;cios, auxiliando no desenvolvimento integral do ser.<br />No aspecto f&iacute;sico, proporciona um fortalecimento de t&ocirc;nus muscular, melhora nos aparelhos respirat&oacute;rio e circulat&oacute;rio, melhora do apetite e sono mais regular. J&aacute; no aspecto ps&iacute;quico, a nata&ccedil;&atilde;o propicia maior rapidez de resposta da crian&ccedil;a a est&iacute;mulo externo.</div>', '<p align=\"justify\">Outro benef&iacute;cio &eacute; a socializa&ccedil;&atilde;o, pois na piscina a crian&ccedil;a est&aacute; em contato com outras crian&ccedil;as e com o professor. Durante as aulas, elas t&ecirc;m a oportunidade de interagir em grupo com brincadeiras, contribuindo com a sociabiliza&ccedil;&atilde;o.<br />No aspecto sa&uacute;de, a nata&ccedil;&atilde;o favorece o desenvolvimento dos mecanismos fisiol&oacute;gicos, como a capacidade pulmonar e o sistema vascular. Com a pr&aacute;tica da nata&ccedil;&atilde;o, a crian&ccedil;a &eacute; submetida a mudan&ccedil;as de temperatura, aumentando sua capacidade de desenvolver anticorpos, favorecendo sua resist&ecirc;ncia e deixando o sistema imunol&oacute;gico mais fortalecido.<br />Por tudo isso a crian&ccedil;a s&oacute; tem a ganhar com a pr&aacute;tica, ajudando a crian&ccedil;a a ter um crescimento mais saud&aacute;vel e equilibrado. </p><p align=\"justify\">&nbsp;</p><p><table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"294\" align=\"center\" style=\"width: 294px; height: 120px\"><tbody><tr><td colspan=\"2\" align=\"center\"><div align=\"center\"><strong>Nata&ccedil;&atilde;o</strong></div></td></tr><tr><td width=\"150\" align=\"center\"><div align=\"center\"><strong>Dia</strong></div></td><td width=\"150\" align=\"center\"><div align=\"center\"><strong>Hor&aacute;rio</strong></div></td></tr><tr><td align=\"center\"><div align=\"center\"><strong>3&ordf; e 5&ordf; feira</strong></div></td><td align=\"center\"><div align=\"center\"><strong>9h30 &agrave;s 10h30min&nbsp;</strong></div></td></tr><tr><td align=\"center\"><div align=\"center\"><strong>3&ordf; e 5&ordf; feira</strong></div></td><td align=\"center\"><div align=\"center\"><strong>14h &agrave;s 14h45min</strong></div></td></tr><tr><td colspan=\"2\" align=\"center\"><div align=\"center\"><strong>Academia Civi<br />R Germano Wetzel, 200</strong></div></td></tr></tbody></table></p>', '1', '11', '0', '22', '2006-05-24 10:46:17', '68', '', '2008-04-10 09:37:02', '68', '0', '0000-00-00 00:00:00', '2006-05-24 10:42:09', '0000-00-00 00:00:00', 'natacao4.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '11', '0', '5', '', '', '0', '820');
INSERT INTO `#__content` VALUES ('117', 'Passeio 3 Srie Estrada Bonita', '', '<p>Os alunos da 3&ordf; s&eacute;rie fizeram um belo passeio na Estrada Bonita. Conheceram os h&aacute;bitos&nbsp;&nbsp;&nbsp;&nbsp; dos agricultores: a rotina, alimenta&ccedil;&atilde;o, os produtos comercializados...E para finalizar andaram de trator, onde conheceram melhor a regi&atilde;o.</p><p>{mosimage}<a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=69\">Confira as fotos!!!</a></p><p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\" align=\"justify\">&nbsp;</p>', '', '1', '1', '0', '1', '2007-05-03 11:53:37', '68', '', '2007-05-03 16:08:46', '68', '0', '0000-00-00 00:00:00', '2007-05-03 11:49:33', '0000-00-00 00:00:00', 'chamadinha estrada bonita 3 serie.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '8', '0', '32', '', '', '0', '93');
INSERT INTO `#__content` VALUES ('28', 'Jazz', '', '<div align=\"justify\">A aula de Jazz representa mais uma op&ccedil;&atilde;o, para os alunos do Ensino Fundamental, proporcionando uma harmonia com a m&uacute;sica e corpo.<br /></div><div align=\"justify\">Confira &nbsp;Fotos <a href=\"component/option,com_zoom/Itemid,99999999/catid,41/\">Grupo 2007</a></div><div align=\"justify\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<a href=\"component/option,com_zoom/Itemid,99999999/catid,114/\">Grupo 2008</a></div><div align=\"center\">u{mosimage}</div>', '<table border=\"1\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\" bordercolor=\"#000000\"><tbody><tr><td class=\"textobr\" width=\"150\" align=\"center\"><strong>Dia</strong></td><td class=\"textobr\" width=\"150\" align=\"center\"><strong>Hor&aacute;rio</strong></td></tr><tr><td class=\"textobr\" align=\"center\">3a e 5a feira</td><td class=\"textobr\" align=\"center\">16h &agrave;s 17h.</td></tr><tr><td class=\"textobr\" colspan=\"2\" align=\"center\">Prof&ordf; Juliana Regina Crestani</td></tr></tbody></table><p class=\"texto\" align=\"center\">&nbsp;</p>', '1', '11', '0', '22', '2006-05-24 11:17:11', '68', '', '2008-12-18 03:18:20', '68', '0', '0000-00-00 00:00:00', '2006-05-24 11:15:20', '0000-00-00 00:00:00', 'jazz.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '14', '0', '4', '', '', '0', '499');
INSERT INTO `#__content` VALUES ('79', 'Feira Culrural 2006', '', '<span style=\"font-size: 10pt; font-family: Arial\"><font color=\"#000000\">{mosimage}Dia 18 de novembro, o Centro de Educa&ccedil;&atilde;o Oficina dos Sonhos, promoveu a 4&ordf; Feira Cultural: <strong><em>&ldquo;Viver feliz com muita arte!&rdquo;</em></strong>, foram apresentados trabalhos desenvolvidos em sala.</font></span><span style=\"font-size: 10pt; font-family: Arial\"><font color=\"#000000\">Foram explorados artistas brasileiros como: Romero Brito, Tarsila do Amaral, Candido Portinari e Alfredo Volpi. </font></span><span style=\"font-size: 10pt; font-family: Arial\"><font color=\"#000000\">Com muitas cores, formas... constru&iacute;ram releituras, instala&ccedil;&otilde;es para representar a arte que estes pintores usavam, curiosidades sobre suas vidas... e muito mais foram apresentados com desenvoltura por nossos alunos.</font></span><span style=\"font-size: 10pt; font-family: Arial\"><font color=\"#000000\">Era vis&iacute;vel em seus olhares a alegria e satisfa&ccedil;&atilde;o em apresentar o que aprenderam com prazer.</font></span><strong><em><span style=\"font-size: 10pt; font-family: Arial\"><font color=\"#000000\">Parab&eacute;ns a todos os envolvidos com a organiza&ccedil;&atilde;o, alunos, </font></span></em></strong><strong><em><span style=\"font-size: 10pt; font-family: Arial\"><font color=\"#000000\">pais e familiares </font></span></em></strong><strong><em><span style=\"font-size: 10pt; font-family: Arial\"><font color=\"#000000\">que puderam compartilhar deste trabalho!!!</font></span></em></strong><strong><em><span style=\"font-size: 10pt; font-family: Arial\"><font color=\"#000000\">&nbsp;</font></span></em></strong><span style=\"font-size: 10pt\"><font face=\"Times New Roman\" color=\"#000000\">&nbsp;</font></span> <p><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=45\">Confira as fotos!!!</a></p>', '', '1', '1', '0', '1', '2006-11-28 16:00:42', '68', '', '2008-05-14 16:29:40', '68', '0', '0000-00-00 00:00:00', '2006-11-28 15:41:16', '0000-00-00 00:00:00', 'chamada feira.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '5', '0', '44', '', '', '0', '113');
