INSERT INTO `#__content` VALUES ('129', '5 Feira Cultural', '', '<p>{mosimage}{mosimage}Na Feira Cultural deste ano da Oficina, os alunos trabalharam a &quot;<strong> Diversidade&nbsp;&nbsp; dos Povos&quot; .</strong> Pequenas salas de aula se transformaram em pa&iacute;ses como Holanda, &Aacute;frica do Sul, Austr&aacute;lia, Kuwait, Gr&eacute;cia, Chile, Tail&acirc;ndia e o nosso Brasil. As fam&iacute;lias que visitaram ficaram muito encantadas com os detalhes da exposi&ccedil;&atilde;o.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=83\">Confira as fotos!!!</a></p>', '', '1', '1', '0', '1', '2007-11-14 18:42:57', '68', '', '2007-11-14 22:03:09', '68', '0', '0000-00-00 00:00:00', '2007-11-14 18:31:43', '0000-00-00 00:00:00', 'chamadinha 5 feira.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '5', '0', '19', '', '', '0', '187');
