> <p align=\"left\">- Mulher&nbsp;&Uacute;nica&nbsp;&nbsp;(Edwin e Nancy Cole/Universidade da Fam&iacute;lia)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p></span>&nbsp;&nbsp;&nbsp;&nbsp; </span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"width: 414px; height: 123px\" class=\"back_button contentheading\"> <h5 class=\"sectiontableentry2 small\" align=\"left\">- Como realmente amar seu filho -&nbsp; Ross Campell&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </h5><h5 class=\"contentcolumn contentpagetitle searchinto sectiontableentry2 small small\" align=\"left\">- EDUCANDO CRIAN&Ccedil;AS GENIOSAS - Dr. James Dobson&nbsp;&nbsp;&nbsp;</h5><h5 class=\"contentpagetitle searchinto sectiontableentry2 small small\" align=\"left\">- TODO FILHO PRECISA DE UMA M&Atilde;E QUE ORA - Janet Kobobel&nbsp;</h5></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ', '', '1', '8', '0', '20', '2006-06-12 18:20:04', '68', '', '2008-04-10 14:29:04', '68', '0', '0000-00-00 00:00:00', '2006-06-12 18:19:23', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '18', '0', '3', '', '', '0', '407');
INSERT INTO `#__content` VALUES ('32', 'Boas Vindas', '', '<p>&nbsp;</p><address class=\"sectiontableentry1\" style=\"margin: 11.25pt; line-height: 119%\"><span style=\"font-size: 14pt; color: #333333; line-height: 119%; font-family: &#39;Arial Narrow&#39;; language: EN\">&ldquo;Que o meu ensino caia como chuva e as minhas palavras des&ccedil;am como orvalho, como chuva branda sobre o pasto novo, como garoa sobre tenras plantas&rdquo;.&nbsp;&nbsp; </span><span style=\"font-size: 14pt; color: #333333; line-height: 119%; font-style: italic; font-family: &#39;Arial Narrow&#39;; language: EN\">(Dt 32.2)</span></address><p style=\"language: EN\" align=\"center\">&nbsp;{mosimage}</p>', '', '1', '9', '0', '19', '2006-06-12 18:27:32', '62', '', '2007-03-19 17:45:31', '68', '0', '0000-00-00 00:00:00', '2006-06-12 18:26:49', '0000-00-00 00:00:00', '4732a73c70011d7f001.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '2', '', '', '0', '32');
INSERT INTO `#__content` VALUES ('130', 'Jud', '', '<p align=\"center\"><span style=\"font-size: 8.5pt; color: #475581; font-family: Tahoma\"><span style=\"font-size: 10pt; color: #475581; font-family: Tahoma\">{mosimage}</span></span></p><p align=\"justify\"><span style=\"font-size: 8.5pt; color: #475581; font-family: Tahoma\"><span style=\"font-size: 10pt; color: #475581; font-family: Tahoma\">Um&nbsp;estilo de luta que hoje em dia denominamos como Jud&ocirc; foi idealizado no ano de 1882. Um jovem de 23 anos chamado Jigoro Kano fundava o Instituto Kodokan, que veio a se tornar a Meca dos ensinamentos sobre esta arte marcial. <br /><br />Com milhares de praticantes e federa&ccedil;&otilde;es espalhados pelo mundo, o Jud&ocirc; se tornou um dos esportes mais praticados, representando um nicho de mercado fiel e bem definido. N&atilde;o restringindo seus adeptos a homens com vigor f&iacute;sico, e estendendo seus ensinamentos para mulheres, crian&ccedil;as e idosos, o jud&ocirc; teve um aumento significativo no n&uacute;mero de amantes desta nobre arte. <br /><br />O Jud&ocirc; tem como filosofia integrar corpo e mente. Sua t&eacute;cnica utiliza os m&uacute;sculos e a velocidade de racioc&iacute;nio para dominar o oponente A vit&oacute;ria, ainda segundo seu mestre fundador, representa um fortalecimento espiritual. Nas academias, procura-se passar algo mais al&eacute;m da luta, do contato f&iacute;sico. Para tornar-se um bom lutador, antes de tudo, &eacute; preciso ser um grande ser humano. </span><span style=\"font-size: 10pt; color: #475581; font-family: Tahoma\">&Eacute; reconhecido como um esporte saud&aacute;vel que n&atilde;o est&aacute; relacionado &agrave; viol&ecirc;ncia. <br />Um esporte de princ&iacute;pios, tamb&eacute;m considerado uma arte, uma filosofia de vida, admirado, respeitado, vitorioso e de grande prest&iacute;gio. </span><br /></span></p>', '', '1', '11', '0', '22', '2007-11-14 22:47:56', '68', '', '2008-04-10 09:14:44', '68', '0', '0000-00-00 00:00:00', '2007-11-14 22:33:28', '0000-00-00 00:00:00', 'judo.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '5', '0', '2', '', '', '0', '610');
INSERT INTO `#__content` VALUES ('36', 'teste', 'teste', '<html>\r\n<head>\r\n\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=iso-8859-1\">\r\n<style type=\"text/css\">\r\n<!--\r\n\r\n.style3 {font-family: \"Trebuchet MS\"}\r\n.style5 {color: #FF0000}\r\n-->\r\n</style>\r\n</head>\r\n<body>\r\n<p class=\"style3 style5\"><strong>Mam&atilde;es!!!! </strong></p>\r\n<p class=\"style3\">Gostar&iacute;amos de agradecer a presen&ccedil;a de todas na Noite do Soninho!!!</p>\r\n<p class=\"style3\">  <em>Reflex&atilde;o!!! </em></p>\r\n<p class=\"style3\">Tu criaste todas as partes internas de meu corpo, enquanto eu ainda estava no ventre da minha m&atilde;e...Eu te agrade&ccedil;o por me teres criado de maneira t&atilde;o diferente e maravilhosa. Sl.139-13,14 </p>\r\n<p class=\"style3\">Quem poderia fazer algo t&atilde;o perfeito... <br />\r\nUma sementinha no ventre... <br />\r\nO nascimento de um filho...nove meses para desenvolver e formar a perfei&ccedil;&atilde;o... <br />\r\nBeb&ecirc;s que crescem como uma por&ccedil;&atilde;o de fermento... <br />\r\nAdolescentes cr&iacute;ticos... <br />\r\nE agora mulheres m&atilde;es... <br />\r\nQuem poderia ser o mestre desta maravilhosa obra??? <br />\r\nEm seus olhos... o olhar do amor... <br />Em seu sorriso... o cuidado... <br />\r\nEm seu cora&ccedil;&atilde;o... a d&aacute;diva do compartilhar... <br />\r\nM&atilde;e, obra divina...<br />\r\nSomente Deus poderia ser autor desta aben&ccedil;oada obra!!! <br />\r\nCom imenso carinho que recebemos voc&ecirc;s para comemorar este dia t&atilde;o especial... que preparamos cada detalhe para acolher todas voc&ecirc;s neste Jardim t&atilde;o florido: violetas, margaridas, tulipas, rosas... </p>\r\n<p class=\"style3\"><em>Parab&eacute;ns pelo sempre Dia das M&atilde;es!!! </em></p>\r\n<p class=\"style3\">Com carinho,</p>\r\n<span class=\"style3\">Fam&iacute;lia Oficina dos Sonhos </span>\r\n<p align=\"center\" class=\"style3\">&nbsp; </p>\r\n<p align=\"center\"><span class=\"style2\"></span>\r\n</p>\r\n<p align=\"center\" class=\"style1\">&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', '1', '2', '0', '3', '2006-06-12 18:51:36', '62', '', '0000-00-00 00:00:00', '0', '0', '0000-00-00 00:00:00', '2006-06-12 18:51:22', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '1', '0', '1', '', '', '0', '0');
INSERT INTO `#__content` VALUES ('37', 'Museu Sambaqui e Parque Caieiras', '', '<html>\r\n<head>\r\n\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=iso-8859-1\">\r\n<style type=\"text/css\">\r\n<!--\r\n\r\n.style3 {font-family: \"Trebuchet MS\"}\r\n.style5 {color: #FF0000}\r\n-->\r\n</style>\r\n</head>\r\n<body>\r\n<p align=\"justify\" class=\"style3\">A 5&ordf; s&eacute;rie realizou no dia 26 de maio um passeio de estudo pelo Parque Ambiental da Caieira e Museu do Sambaqui. O Parque da Caieira que abriga preciosos ecossistemas de manguezais e restingas, tamb&eacute;m mant&eacute;m &aacute;reas de sambaquis preservadas e o Museu do Sambaqui re&uacute;ne mais de 10.000 pe&ccedil;as arqueol&oacute;gicas. </p>\r\n<p align=\"justify\"><span class=\"style3\">Foi uma manh&atilde; de muito aprendizado, que enriqueceu ainda mais as aulas de hist&oacute;ria ministradas pela professora Gizele de C. Barros</span>. </p>\r\n<p class=\"style3 style5\">&nbsp;\r\n</p>\r\n<p align=\"center\" class=\"style3\">&nbsp; </p>\r\n<p align=\"center\"><span class=\"style2\"></span>\r\n</p>\r\n<p align=\"center\" class=\"style1\">&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', '0', '1', '0', '1', '2006-06-12 18:59:33', '62', '', '0000-00-00 00:00:00', '0', '0', '0000-00-00 00:00:00', '2006-06-12 18:58:45', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '1', '0', '60', '', '', '0', '780');
INSERT INTO `#__content` VALUES ('38', 'Passeio para Estrada Bonita', '', '<html>\r\n<head>\r\n\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=iso-8859-1\">\r\n<style type=\"text/css\">\r\n<!--\r\n\r\n.style3 {font-family: \"Trebuchet MS\"}\r\n.style5 {color: #FF0000}\r\n.style6 {\r\n	color: #990000;\r\n	font-weight: bold;\r\n	font-family: \"Trebuchet MS\";\r\n}\r\n-->\r\n</style>\r\n</head>\r\n<body>\r\n<p class=\"style6\">Passeando pelo Meio Rural... </p>\r\n<p class=\"style3\">Foi na Estrada Bonita que as turmas de 3&ordf; s&eacute;rie, se deliciaram com a vida do homem do campo. </p>\r\n<p class=\"style3\">Com alegria aproveitaram o S&iacute;tio do Sr. Ango, para observar tudo aquilo que a natureza tem a oferecer, al&eacute;m da linda paisagem, o cultivo da cana-de-a&ccedil;ucar, as partes do rio, os instrumentos de trabalho, o filtro alem&atilde;o, a cria&ccedil;&atilde;o de animais entre outros. </p>\r\n<p class=\"style3\">Tiveram tamb&eacute;m a oportunidade de vivenciar o conte&uacute;do: sistema monet&aacute;rio, discutido em sala de aula, com as compras dos produtos artesanais. </p>\r\n<p class=\"style3\">E para finalizar a aula de campo, uma paradinha para um delicioso pastel caseiro. </p>\r\n<p align=\"justify\" class=\"style3\">&nbsp;</p>\r\n<p class=\"style3 style5\">&nbsp;\r\n</p>\r\n<p align=\"center\" class=\"style3\">&nbsp; </p>\r\n<p align=\"center\"><span class=\"style2\"></span>\r\n</p>\r\n<p align=\"center\" class=\"style1\">&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', '0', '1', '0', '1', '2006-06-12 19:07:09', '62', '', '0000-00-00 00:00:00', '0', '0', '0000-00-00 00:00:00', '2006-06-12 19:06:19', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '1', '0', '59', '', '', '0', '559');
INSERT INTO `#__content` VALUES ('39', 'Passeio no Museu da Fundio', '', '<html>\r\n<head>\r\n\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=iso-8859-1\">\r\n<style type=\"text/css\">\r\n<!--\r\n\r\n.style3 {font-family: \"Trebuchet MS\"}\r\n.style5 {color: #FF0000}\r\n.style6 {\r\n	color: #990000;\r\n	font-weight: bold;\r\n	font-family: \"Trebuchet MS\";\r\n}\r\n-->\r\n</style>\r\n</head>\r\n<body>\r\n<p class=\"style3\"> A turma da pr&eacute;-escola, dia 15 de maio, realizou um passeio ao Museu de Fundi&ccedil;&atilde;o Tupy com o intuito de permitir que as crian&ccedil;as observassem a possibilidade de reutilizar materiais utilizados no dia-a-dia, colaborando com o ambiente atrav&eacute;s da redu&ccedil;&atilde;o do lixo. </p>\r\n<p align=\"justify\" class=\"style3\">&nbsp;</p>\r\n<p class=\"style3 style5\">&nbsp;\r\n</p>\r\n<p align=\"center\" class=\"style3\">&nbsp; </p>\r\n<p align=\"center\"><span class=\"style2\"></span>\r\n</p>\r\n<p align=\"center\" class=\"style1\">&nbsp;</p>\r\n</body>\r\n</html>\r\n', '', '0', '1', '0', '1', '2006-06-12 19:09:15', '62', '', '0000-00-00 00:00:00', '0', '0', '0000-00-00 00:00:00', '2006-06-12 19:08:27', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '1', '0', '58', '', '', '0', '484');
INSERT INTO `#__content` VALUES ('131', 'Tcnica Vocal', '', '<span class=\"style272\"><h5 style=\"margin: auto 0cm\" class=\"style266\" align=\"justify\"><span style=\"font-weight: normal; font-size: 10pt\">Nas aulas de t&eacute;cnica vocal usamos a voz a servi&ccedil;o da m&uacute;sica, utiliza o sopro e possibilita modular, enriquecer e sustentar as sonoridades vocais e torn&aacute;-las mais expressivas.</span><span style=\"font-size: 10pt\"><br /></span><span style=\"font-weight: normal; font-size: 10pt\">Entre o corpo e a voz existe uma &iacute;ntima rela&ccedil;&atilde;o. &Eacute; com eles que o cantor exterioriza sua afetividade e desempenha o papel intermedi&aacute;rio entre o p&uacute;blico e a obra musical. Mas, para isso &eacute; preciso que ele possua uma t&eacute;cnica precisa e impec&aacute;vel a fim de poder dominar as in&uacute;meras dificuldades que vai encontrar.</span><span class=\"style2721\"><span style=\"font-weight: normal; font-size: 10pt; font-family: &#39;Times New Roman&#39;\"><span>&nbsp;</span><span>&nbsp;</span>Nas aulas de canto &eacute; <span>&nbsp;</span>abordado todos os aspectos da arte de cantar. </span></span><span class=\"style2721\"><span style=\"font-weight: normal; font-size: 10pt; font-family: &#39;Times New Roman&#39;\">Voc&ecirc; aprende todas as t&eacute;cnicas e a import&acirc;ncia pr&aacute;tica dos recursos de t&eacute;cnica vocal. </span></span></h5></span>', '', '1', '11', '0', '22', '2007-11-14 23:53:06', '68', '', '2008-04-10 09:15:04', '68', '0', '0000-00-00 00:00:00', '2007-11-14 23:47:10', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '3', '0', '1', '', '', '0', '301');
INSERT INTO `#__content` VALUES ('42', 'Visita Estrada Bonita', '', '<hr /><p style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><strong><font size=\"3\"><font color=\"#000000\"><font face=\"Times New Roman\">{mosimage}Visita na Estrada Bonita</font></font></font></strong></p><strong><font size=\"3\"><font color=\"#000000\"></font></font></strong>&nbsp; <p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\" align=\"justify\"><font face=\"Times New Roman\" size=\"3\" color=\"#000000\">Neste m&ecirc;s a turma do Jardim 3 foi visitar a zona rural para conhecer os h&aacute;bitos dos agricultores: alimenta&ccedil;&atilde;o, o trabalho, a rotina etc. Ficaram encantados com o espa&ccedil;o, a linda paisagem verde, o bezerro que tinha acabado de nascer, o trator, enfim tudo que a natureza tem a nos oferecer. Vale conferir!</font></p><p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\">&nbsp;</p><font face=\"Times New Roman\" size=\"3\" color=\"#000000\"><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=18\"></a><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=18\"><p align=\"center\">Veja as Fotos do Passeio na Estrada Bonita</p></a><p>&nbsp;</p></font>', '', '0', '1', '0', '1', '2006-07-11 19:56:02', '63', '', '2006-07-11 19:57:00', '63', '0', '0000-00-00 00:00:00', '2006-07-11 19:53:56', '0000-00-00 00:00:00', 'noticias/imagem-190p.jpg|left||0||bottom||', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '2', '0', '57', '', '', '0', '500');
INSERT INTO `#__content` VALUES ('43', 'Passeio no Zoolgico!', '', '<strong><font size=\"3\"><font color=\"#000000\"><font face=\"Times New Roman\"><hr />{mosimage}<br />Passeio no&nbsp;Zool&oacute;gico </font></font></font></strong><p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\" align=\"center\"><font face=\"Times New Roman\" size=\"3\" color=\"#000000\">As turmas da 4&ordf; e 6&ordf; s&eacute;rie, foram visitar o Zool&oacute;gico de Pomerode, al&eacute;m da confraterniza&ccedil;&atilde;o foram para apreciar as diferentes esp&eacute;cies de animais brasileiros, assuntos que dar&atilde;o continuidade em sala. Confira!<br /><br /><span class=\"button\"><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=19\">Veja as Fotos do Passeio no Zoo</a>l&oacute;gico</span></font></p>', '', '0', '1', '0', '1', '2006-07-11 20:37:46', '63', '', '2006-07-11 20:47:50', '63', '0', '0000-00-00 00:00:00', '2006-07-11 20:33:44', '0000-00-00 00:00:00', 'noticias/imagem-024p.jpg|right||0||bottom|right|', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '8', '0', '56', '', '', '0', '541');
