INSERT INTO `#__content` VALUES ('78', 'Indicao de Leitura', '', '<p><a href=\"http://www.hagnos.com.br\" target=\"_blank\"></a></p><p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\" align=\"center\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong><font face=\"Times New Roman\" size=\"2\" color=\"#000000\">Revista Crescer &ndash; Maio / 2007</font></strong> </p><p style=\"font-size: 10pt; margin: 0cm 0cm 0pt; text-align: center\" class=\"MsoNormal\" align=\"center\">acesse e leia</p><p style=\"margin: 0cm 0cm 0pt; text-align: center\" class=\"MsoNormal\" align=\"center\"><span style=\"font-size: 10pt; color: red\"><a href=\"http://www.crescer.globo.com/\"><span style=\"color: red\"><u><font face=\"Times New Roman\">www.crescer.globo.com</font></u></span></a></span></p><p align=\"left\">&nbsp;</p><p><span style=\"font-size: 10pt; font-family: &#39;Arial Narrow&#39;\"><font color=\"#000000\">Pg. 25 &ndash; Tosse chata - tipos de tosse, medidas de al&iacute;vio, xarope funciona?</font></span></p><p><span style=\"font-size: 10pt; font-family: &#39;Arial Narrow&#39;\"><font color=\"#000000\">Pg. 50 &ndash; Cocoric&oacute; em gibi &ndash; Agora em quadrinhos, nas bancas, o premiado programa infantil que nasceu na TV Cultura.</font></span></p><p><span style=\"font-size: 10pt; font-family: &#39;Arial Narrow&#39;\"><font color=\"#000000\">Pg. 52 &ndash; Inimigo P&uacute;blico?? Seu filho faz esc&acirc;ndalos no meio do supermercado, na casa de amigo, no shopping, restaurante... Conhe&ccedil;a dicas que poder&atilde;o ajudar voc&ecirc; a resolver o problema.</font></span></p><p><span style=\"font-size: 10pt; font-family: &#39;Arial Narrow&#39;\"><font color=\"#000000\">Pg. 82 &ndash; Seu filho &eacute; hipocondr&iacute;aco?Crian&ccedil;a tamb&eacute;m tem mania de doen&ccedil;a</font></span></p><p><span style=\"font-size: 10pt; font-family: &#39;Arial Narrow&#39;\"><font color=\"#000000\">Pg. 86 &ndash; O que fazer quando a crian&ccedil;a bate na m&atilde;e.</font></span></p><p><span style=\"font-size: 10pt; font-family: &#39;Arial Narrow&#39;\"><font color=\"#000000\">Pg. 88 &ndash; Quando tirar a crian&ccedil;a do ber&ccedil;o?</font></span> </p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', '', '1', '15', '0', '33', '2006-11-23 16:52:37', '68', '', '2007-05-25 10:49:44', '68', '0', '0000-00-00 00:00:00', '2006-11-23 16:47:30', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '11', '0', '4', '', '', '0', '237');
INSERT INTO `#__content` VALUES ('61', 'Desfile Cvico', '', '<p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\"><font face=\"Times New Roman\" size=\"3\" color=\"#000000\">{mosimage}</font></p><p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\"><font face=\"Times New Roman\" size=\"3\" color=\"#000000\">Para marcar o dia da Independ&ecirc;ncia do Brasil nossos alunos representaram &agrave; escola desfilando com alegria e levando cartazes para contar um pouco de nossa hist&oacute;ria.</font></p><font size=\"3\"><font color=\"#000000\"><font face=\"Times New Roman\"><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=23\">Confira!</a></font></font></font>', '', '1', '1', '0', '1', '2006-10-13 14:39:26', '84', '', '2006-10-16 19:21:56', '68', '0', '0000-00-00 00:00:00', '2006-10-13 14:15:56', '0000-00-00 00:00:00', 'imagem 056.jpg|||0||bottom||', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '3', '0', '55', '', '', '0', '69');
INSERT INTO `#__content` VALUES ('48', 'Proposta Pedaggica', '', '<p>O Centro de Educa&ccedil;&atilde;o Oficina dos Sonhos al&eacute;m de trabalhar todas as habilidades cognitiva, motora, emocional, social...<br />Est&aacute; tamb&eacute;m baseado no seguinte valor:<br /><strong><em>&ldquo;Ainda que eu falasse as l&iacute;nguas dos homens e dos anjos, e n&atilde;o tivesse amor, seria como o metal que soa ou como o sino que tine&rdquo;<br />(I Cor&iacute;ntios 13-1)<br />O amor &eacute; base de toda a ess&ecirc;ncia HUMANA!!&nbsp; <br /></em></strong>A palavra amor vem do latim amor, que quer dizer: &ldquo;amizade, dedica&ccedil;&atilde;o, afei&ccedil;&atilde;o, ternura, desejo grande, paix&atilde;o, objeto amado&rdquo;.</p>&Eacute; desta forma que recebemos todas as nossas crian&ccedil;as!', '<p>Poema de Lu&iacute;s de Cam&otilde;es, que, para muitos, foi o respons&aacute;vel por criar a linguagem do amor em l&iacute;ngua portuguesa. &Eacute; o que expressa o soneto abaixo:<br />Amor &eacute; fogo que arde sem se ver<br />&Eacute; ferida que d&oacute;i e n&atilde;o se sente<br />&Eacute; um contentamento descontente<br />&Eacute; dor que desatina sem doer<br />&Eacute; um n&atilde;o querer, mais que bem querer<br />&Eacute; solit&aacute;rio andar por entre a gente<br />&Eacute; nunca contentar-se de contente<br />&Eacute; cuidar que se ganha em se perder<br />&Eacute; querer estar preso sem vontade<br />&Eacute; servir a quem vence, o vencedor<br />&Eacute; ter com quem nos mata lealdade<br />Mas como causar pode se favor <br />Nos cora&ccedil;&otilde;es humanos amizade<br />Se t&atilde;o contr&aacute;rio a sim &eacute; o mesmo amor?<br /><strong>Evelize da Cunha</strong><br /><strong>Coordenadora Pedag&oacute;gica</strong></p>', '1', '8', '0', '20', '2006-08-11 13:41:26', '68', '', '2008-03-26 17:01:20', '68', '0', '0000-00-00 00:00:00', '2006-08-11 13:38:34', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '2', '', '', '0', '844');
INSERT INTO `#__content` VALUES ('51', 'Projeto Educao Crist', '', 'O Projeto Educa&ccedil;&atilde;o Crist&atilde; tem por princ&iacute;pios resgatar valores que est&atilde;o sendo distintos de nossa sociedade como: amor ao pr&oacute;ximo, respeito aos mais velhos, companheirismo, uni&atilde;o... Com base em hist&oacute;rias, m&uacute;sicas, que estejam relacionados aos conceitos b&iacute;blicos. <p align=\"center\"><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=10\">Clique aqui para ver as fotos do projeto!</a></p>', '', '1', '8', '0', '30', '2006-08-11 15:31:36', '68', '', '2008-04-10 11:16:25', '68', '0', '0000-00-00 00:00:00', '2006-08-11 15:26:18', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '9', '', '', '0', '94');
INSERT INTO `#__content` VALUES ('54', 'Projeto de Msica', 'Projeto de Msica', '<h4 class=\"mosimage_caption\" align=\"center\">&quot; Cantarei e&nbsp;salmodiarei ao Senhor&quot; Salmos 27:6d&nbsp;</h4><p align=\"justify\">Demonstrar o valor construtivo da m&uacute;sica na Educa&ccedil;&atilde;o Infantil e restabelecer a rela&ccedil;&atilde;o da m&uacute;sica com a constru&ccedil;&atilde;o do conhecimento. Estimular na crian&ccedil;a a capacidade de percep&ccedil;&atilde;o, sensibilidade, imagina&ccedil;&atilde;o, cria&ccedil;&atilde;o, bem como age como uma recrea&ccedil;&atilde;o educativa, sociabilizando, disciplinando e desenvolvendo a sua aten&ccedil;&atilde;o. Desenvolver diversas habilidades ligadas tanto &agrave;s &aacute;reas motoras, cognitivas e afetivas, promovendo a forma&ccedil;&atilde;o integral das crian&ccedil;as. </p><p align=\"justify\">As aulas s&atilde;o ministradas 1 vez por semana pelo professor&nbsp;Marcelo Pecher&nbsp;com muita m&uacute;sica, instrumentos variados e a empolga&ccedil;&atilde;o dos alunos...</p><p align=\"center\"><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=95\">Clique aqui para ver as fotos do projeto!</a></p>', '', '1', '8', '0', '30', '2006-08-13 22:42:30', '68', '', '2008-04-10 12:14:38', '68', '0', '0000-00-00 00:00:00', '2006-08-13 22:41:38', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '5', '0', '8', '', '', '0', '72');
