INSERT INTO `#__content` VALUES ('123', 'Mini PAN na Oficina', '', '{mosimage}No &uacute;ltimo dia 13 de Julho os alunos da oficina dos Sonhos tiveram uma manh&atilde; na Sede de Campo muito atrativa....Participaram do <strong>Mini PAN, </strong>onde puderam inscrever-se na modalidade preferida: carat&ecirc;, basquete, corrida, futebol, salto em dist&acirc;ncia e outros...<a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=78\"> confira!!!</a>', '', '1', '1', '0', '1', '2007-07-24 14:24:11', '68', '', '2007-07-24 16:00:16', '68', '0', '0000-00-00 00:00:00', '2007-07-24 14:17:25', '0000-00-00 00:00:00', 'chamadinha pan.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '5', '0', '24', '', '', '0', '151');
INSERT INTO `#__content` VALUES ('72', 'Olimpada SOS', '', '<p>Na Semana das Crian&ccedil;as, nossos alunos participaram da Olimp&iacute;ada Solid&aacute;rios Oficina dos Sonhos.</p><p>Foram 30 dias de muita divers&acirc;o e alegria...al&eacute;m de aprender a import&acirc;ncia de aben&ccedil;oar o pr&oacute;ximo.</p><p>Confira as fotos!!!!</p>', '', '1', '1', '0', '1', '2006-10-26 17:52:25', '84', '', '0000-00-00 00:00:00', '0', '0', '0000-00-00 00:00:00', '2006-10-26 17:46:22', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '1', '0', '48', '', '', '0', '91');
