INSERT INTO `#__content` VALUES ('76', 'Acampamento 2006', '', '<address><span style=\"font-family: &#39;Arial Rounded MT Bold&#39;\"><font size=\"3\"><font color=\"#000000\">{mosimage}&nbsp; <span style=\"color: black; font-family: &#39;Bodoni MT&#39;\">Lazer, divers&atilde;o, aprendizagem, natureza...Tudo isso e muito mais aconteceu</span><span style=\"color: black; font-family: &#39;Bodoni MT&#39;\">no acampamento realizado com as turmas de 5&ordf; e 6&ordf; s&eacute;ries.</span></font></font></span></address><address><span style=\"font-family: &#39;Arial Rounded MT Bold&#39;\"><font size=\"3\"><font color=\"#000000\"><span style=\"color: black; font-family: &#39;Bodoni MT&#39;\">Com certeza , esses </span><span style=\"color: black; font-family: &#39;Bodoni MT&#39;\">momentos juntos ficar&atilde;o registrados em nossas mem&oacute;rias.<span>&nbsp; </span><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=38\">Confira!!!<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&n