INSERT INTO `#__content` VALUES ('74', 'Ballet no Teatro Juarez Machado', '', '<p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\"><font face=\"Times New Roman\" size=\"3\" color=\"#000000\">{mosimage}Para encerrar as atividades nossas bailarinas fizeram sucesso com o espet&aacute;culo: <em>Hist&oacute;rias Inesquec&iacute;veis,</em><span>&nbsp; </span>no dia 16 de novembro, no Teatro Juarez Machado.</font></p><strong><em><font size=\"3\"><font color=\"#000000\"><font face=\"Times New Roman\">Agradecemos a presen&ccedil;a de pais e familiares que prestigiaram o evento!!!</font></font></font></em></strong> <p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\"><font face=\"Times New Roman\" size=\"3\" color=\"#000000\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=37\">Confira!!!</a></font></p><font face=\"Times New Roman\" size=\"3\" color=\"#000000\">&nbsp;</font>', '', '1', '1', '0', '1', '2006-11-22 17:31:18', '68', '', '2006-11-24 16:33:02', '68', '0', '0000-00-00 00:00:00', '2006-11-22 17:24:40', '0000-00-00 00:00:00', 'pb160022.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '46', '', '', '0', '172');
INSERT INTO `#__content` VALUES ('82', 'Ballet no Museu...', '', '<span style=\"font-size: 14pt\"><font color=\"#000000\"><font face=\"Times New Roman\"><p style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><font size=\"3\">{mosimage}Dia 09 de novembro, as bailarinas dan&ccedil;aram com classe na ponta dos p&eacute;s, ao ar livre no jardim do Museu de Imigra&ccedil;&atilde;o e Coloniza&ccedil;&atilde;o.</font></p><p style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><font size=\"3\">Foi um bel&iacute;ssimo espet&aacute;culo!!!</font></p><p style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><font size=\"3\"><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=48\">Confira! </a></font></p></font></font></span>&nbsp;', '', '1', '1', '0', '1', '2006-12-15 15:48:08', '84', '', '2006-12-15 16:25:22', '84', '0', '0000-00-00 00:00:00', '2006-12-15 15:43:13', '0000-00-00 00:00:00', 'chamadinha ballet museu.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '3', '0', '42', '', '', '0', '62');
INSERT INTO `#__content` VALUES ('125', 'Desfile Cvico 7 de Setembro', '', '<p>{mosimage}No dia 4 de Setembro&nbsp; os alunos do Ensino Fundamental&nbsp; participaram&nbsp; do desfile c&iacute;vico&nbsp;na Rua&nbsp; Otto, juntamente com a comunidade do Bairro Costa e Silva.&nbsp;&nbsp;&nbsp;&nbsp;<a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=80\"> Confira!!!</a></p>', '', '1', '1', '0', '1', '2007-09-17 13:51:06', '68', '', '2007-09-17 14:06:51', '68', '0', '0000-00-00 00:00:00', '2007-09-17 13:45:04', '0000-00-00 00:00:00', 'chamdinha desfile civico.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '22', '', '', '0', '197');
INSERT INTO `#__content` VALUES ('126', 'Patinao', '', '<p align=\"left\">&nbsp;&nbsp; {mosimage} </p><table border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"389\" class=\"MsoNormalTable\" align=\"left\" style=\"width: 291.75pt\"><tbody><tr><td colspan=\"2\" style=\"background-color: transparent; border: #ece9d8; padding: 0cm\"><p align=\"justify\"><span style=\"font-size: 8.5pt; color: #666666; font-family: Tahoma\">As aulas de patina&ccedil;&atilde;o t&ecirc;m como objetivo proporcionar aos alunos a mais espetacular e&nbsp;empolgante forma dos esportes sobre rodas a Patina&ccedil;&atilde;o Art&iacute;stica, buscando melhorar a qualidade de vida, envolvendo o aluno em aulas divertidas e descontra&iacute;das, que respeitam a individualidade de cada um.&nbsp;<br /><br />Atrav&eacute;s dos exerc&iacute;cios executados durante as aulas, as&nbsp;habilidades motoras s&atilde;o muito desenvolvidas fazendo com que a crian&ccedil;a tenha um desenvolvimento motor adequado sem exigir uma especializa&ccedil;&atilde;o precoce e sem interferir nos fatores maturacionais. Tamb&eacute;m desenvolve a capacidade de concentra&ccedil;&atilde;o e o relacionamento em grupo de seus alunos e exige responsabilidade e controle emocional nas apresenta&ccedil;&otilde;es ao p&uacute;blico.&nbsp;&nbsp;</span></p><p align=\"justify\"><a href=\"component/option,com_zoom/Itemid,99999999/catid,107/\">Confira as fotos!!!</a> </p></td></tr><tr><td style=\"background-color: transparent; border: #ece9d8; padding: 0cm\"><p align=\"justify\">&nbsp;</p></td><td style=\"background-color: transparent; border: #ece9d8; padding: 0cm\"><p align=\"justify\">&nbsp;</p></td></tr></tbody></table>', '', '-2', '11', '0', '22', '2007-10-02 10:58:02', '68', '', '2008-12-18 03:08:36', '68', '0', '0000-00-00 00:00:00', '2007-10-02 10:57:21', '0000-00-00 00:00:00', '0202.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '22', '0', '0', '', '', '0', '479');
INSERT INTO `#__content` VALUES ('144', 'PROJETO: QUEM FAZ O QU?', '', '<p align=\"center\"><span style=\"font-family: &#39;Comic Sans MS&#39;\" class=\"mosimage_caption\"><font size=\"2\">Per&iacute;odo: 14/04 a 02/05</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&nbsp;</font></span></p><p align=\"justify\"><font size=\"2\"><em style=\"font-family: &#39;Comic Sans MS&#39;\">&ldquo;</em></font><font size=\"2\"><em style=\"font-family: &#39;Comic Sans MS&#39;\"><span>E tamb&eacute;m que todo o homem coma e beba, </span></em></font><font size=\"2\"><em style=\"font-family: &#39;Comic Sans MS&#39;\"><span>e goze do bem de todo o seu trabalho; isto &eacute; um dom de Deus&rdquo;</span></em></font><em><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">(Eclesiastes 3:13)</font></span></em><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&nbsp;</font></span></p><p align=\"justify\"><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">O projeto visa ampliar o repert&oacute;rio das crian&ccedil;as sobre as profiss&otilde;es. Ser&aacute; o momento das crian&ccedil;as falar sobre as profiss&otilde;es que conhecem, principalmente a dos pais, e outras ocupa&ccedil;&otilde;es que gostam. Alguns t&oacute;picos a ser explorados:</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&nbsp;</font></span></p>', '<p align=\"justify\"><span style=\"font: 7pt &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><font size=\"2\"><em><span style=\"font-family: &#39;Comic Sans MS&#39;\"><span>&nbsp;</span>&ldquo;Por acaso Ele n&atilde;o &eacute; o filho do carpinteiro? Mateus 13:55. </span></em><span style=\"font-family: &#39;Comic Sans MS&#39;\">O pai de Jesus era carpinteiro. E o seu?<em>&rdquo;. </em>Pesquisa com o pai e m&atilde;e sobre suas profiss&otilde;es.</span></font>&nbsp;<span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&nbsp;</font></span></p><p align=\"justify\"><font size=\"2\"><span style=\"font-family: Symbol\"><span>&middot;<span style=\"font: 7pt &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family: &#39;Comic Sans MS&#39;\">Mostrar &agrave; crian&ccedil;a como as profiss&otilde;es se articulam e como TODAS s&atilde;o importantes para o bom funcionamento da sociedade.&nbsp;</span></font></p><p align=\"justify\"><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&nbsp;</font></span><font size=\"2\"><span style=\"font-family: Symbol\"><span>&middot;<span style=\"font: 7pt &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family: &#39;Comic Sans MS&#39;\">O que quero ser quando crescer?&nbsp;</span></font></p><p align=\"justify\"><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&nbsp;</font></span><font size=\"2\"><span style=\"font-family: Symbol\"><span>&middot;<span style=\"font: 7pt &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-family: &#39;Comic Sans MS&#39;\">Tem gente que n&atilde;o gosta de nenhum tipo de trabalho... Prov&eacute;rbios 6:6-8 diz:</span><span style=\"font-family: &#39;Comic Sans MS&#39;\"> <em>&ldquo;Pregui&ccedil;oso, aprenda uma li&ccedil;&atilde;o com as formigas! Elas n&atilde;o tem l&iacute;der, nem chefe, nem governador, mas guardam comida no ver&atilde;o, preparando-se para o inverno.&rdquo; </em><span>&nbsp;</span></span></font><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&nbsp;</font></span></p>', '1', '8', '0', '30', '2008-04-23 11:02:22', '68', '', '2008-04-23 11:09:03', '68', '0', '0000-00-00 00:00:00', '2008-04-23 11:00:56', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '3', '', '', '0', '278');
INSERT INTO `#__content` VALUES ('90', 'Visita na Fbrica Arroz Vila Nova', '', '<p>{mosimage}Conversando&nbsp;sobre o processo de fabrica&ccedil;&atilde;o dos alimentos industrializados, a turma da 2&ordf; s&eacute;rie, pode conferir de perto na F&aacute;brica do Arroz Vila Nova.</p><p><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=56\">Veja mais...</a></p>', '', '1', '1', '0', '1', '2006-12-19 10:26:26', '84', '', '2006-12-19 10:35:39', '84', '0', '0000-00-00 00:00:00', '2006-12-19 10:24:30', '0000-00-00 00:00:00', 'arroz vila nova chamada.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '3', '0', '41', '', '', '0', '63');
INSERT INTO `#__content` VALUES ('91', 'Conhecendo a Indstria Mabel', '', '<p><strong>{mosimage}Hummm, que del&iacute;cia!!!</strong></p><p align=\"justify\">Al&eacute;m das deliciosas bolachas... os alunos da 3&ordf; e 4&ordf; s&eacute;rie, observaram&nbsp;os assuntos estudados em sala: as diferen&ccedil;as dos produtos naturais, industrializados e seus&nbsp;diferentes processos.</p><p align=\"justify\"><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=57\">Vale conferir!!!</a>&nbsp;</p>', '', '1', '1', '0', '1', '2006-12-19 10:52:12', '84', '', '2006-12-19 14:17:59', '84', '0', '0000-00-00 00:00:00', '2006-12-19 10:47:24', '0000-00-00 00:00:00', 'mabel chamada.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '5', '0', '40', '', '', '0', '58');
