INSERT INTO `#__content` VALUES ('110', 'Pscoa Sede de Campo', '', '<p><strong>{mosimage}</strong></p><p align=\"justify\"><strong>P&aacute;scoa M&aacute;gica!!!</strong>&nbsp;&nbsp;</p><h5 style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\"><span style=\"font-size: 11pt; color: #333333\"><font face=\"Times New Roman\">Passeio Nova Sede, ca&ccedil;a ao ninho na trilha,&nbsp;Gincana, brincadeiras&nbsp; no Parque </font></span><span style=\"font-size: 11pt; color: #333333\"><font face=\"Times New Roman\">e um delicioso .Ufa...Quanta divers&atilde;o!!&nbsp; Al&eacute;m de muita brincadeira e divers&atilde;o </font></span><span style=\"font-size: 11pt; color: #333333\"><font face=\"Times New Roman\">nesta semana,&nbsp; os alunos conheceram a import&acirc;ncia da P&aacute;scoa para nossas vidas.</font></span><span style=\"font-size: 11pt; color: #333333\"><font face=\"Times New Roman\"><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=61\">Confira!!</a></font></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</h5>', '', '1', '1', '0', '1', '2007-04-20 16:13:51', '68', '', '2007-04-20 17:00:37', '68', '0', '0000-00-00 00:00:00', '2007-04-20 16:04:00', '0000-00-00 00:00:00', 'chamadinha pascoa sede.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '3', '0', '36', '', '', '0', '71');
INSERT INTO `#__content` VALUES ('111', 'Visita Coelho na Oficina', '', '<p><span style=\"font-size: 10pt; color: #333333; line-height: 120%\"><font face=\"Times New Roman\">{mosimage}&nbsp;</font></span></p><span style=\"font-size: 10pt; color: #333333; line-height: 120%\"><font face=\"Times New Roman\">O coelho nos visitou tamb&eacute;m nesta semana aben&ccedil;oada.<span>&nbsp; </span></font></span><span style=\"font-size: 10pt; color: #333333; line-height: 120%\"><font face=\"Times New Roman\">A sua visita fez parte das aulas na sala de aula, tivemos teatro, g</font></span><span style=\"font-size: 10pt; color: #333333; line-height: 120%\"><font face=\"Times New Roman\">incana no Gin&aacute;sio e ainda entrega das lembrancinhas... <a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=63\">Confira as fotos!!!</a></font></span> <p>&nbsp;</p>', '', '1', '1', '0', '1', '2007-04-20 17:12:00', '68', '', '2007-04-27 14:36:48', '84', '0', '0000-00-00 00:00:00', '2007-04-20 17:02:43', '0000-00-00 00:00:00', 'chamadinha coelho na oficina.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '35', '', '', '0', '89');
