INSERT INTO `#__content` VALUES ('136', 'Posse Vereador Mirim 2008', '', '<p>{mosimage}Neste&nbsp; dia 18 de fevereiro a aluna Anne Cristine &nbsp;tomou posse do Cargo de&nbsp;Vereador Mirim 2008.&nbsp; Parab&eacute;ns Anne!!!&nbsp;&nbsp; Voc&ecirc; &eacute; muito importante para a nossa escola!</p><p><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=87\">Confira as fotos!</a></p>', '', '1', '1', '0', '1', '2008-02-27 17:33:18', '68', '', '2008-03-04 17:28:47', '68', '0', '0000-00-00 00:00:00', '2008-02-27 17:23:04', '0000-00-00 00:00:00', 'chamadinha vereador mirin.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '15', '', '', '0', '108');
INSERT INTO `#__content` VALUES ('137', 'Projeto den Day', '', '<p align=\"center\">&nbsp;</p><h5 class=\"mosimage_caption\" align=\"center\"><span style=\"font-size: 9pt; line-height: 150%; font-family: Tahoma\">&quot;Do solo Deus fez brotar toda a sorte de &aacute;rvores agrad&aacute;veis </span><span style=\"font-size: 9pt; line-height: 150%; font-family: Tahoma\">&agrave; vista e boas para alimento;&nbsp;e tamb&eacute;m a &aacute;rvore da vida no</span><span style=\"font-size: 9pt; line-height: 150%; font-family: Tahoma\">meio do jardim, &aacute;rvore do conhecimento&nbsp;&nbsp; do bem e do mal&quot;</span><span style=\"font-size: 9pt; line-height: 150%; font-family: Tahoma\">(G&ecirc;nesis 2:9)</span><span style=\"font-size: 9pt; line-height: 150%; font-family: Tahoma\">&nbsp;</span><span style=\"font-size: 9pt; line-height: 150%; font-family: Tahoma\">&nbsp;</span></h5><p align=\"justify\"><span style=\"font-size: 9pt; line-height: 150%; font-family: Tahoma\"><font color=\"#000000\">Nossos alunos passar&atilde;o uma vez por semana um per&iacute;odo&nbsp;na Sede de Campo, onde ir&atilde;o desfrutar de momento agrad&aacute;veis com atividades de Educa&ccedil;&atilde;o F&iacute;sica, Horta, Meio Ambiente, Lanche e Parque. O transporte ser&aacute; monitorado pela escola.</font></span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"font-size: 9pt; line-height: 150%; font-family: Tahoma\"><font color=\"#000000\"><strong>Por que &Eacute;den Day?</strong></font></span></p><p align=\"justify\"><span style=\"font-size: 9pt; line-height: 150%; font-family: Tahoma\"><font color=\"#000000\">Porque &Eacute;den quer dizer <strong>&ldquo;Lugar protegido e Ref&uacute;gio agrad&aacute;vel</strong>&rdquo;, assim isto poder&aacute; ser desfrutado pelos alunos na Sede de Campo.</font></span><span style=\"font-size: 9pt; line-height: 150%; font-family: Tahoma\"><font color=\"#000000\">O &Eacute;den &eacute; um local de ref&uacute;gio agrad&aacute;vel que&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; tem tudo o que o homem precisa: ALIMENTO, BELEZA, &Aacute;GUA, COMPANHIA DE DEUS E COMPANHERISMO HUMANO.</font></span><span style=\"font-size: 9pt\"><font face=\"Times New Roman\" color=\"#000000\">&nbsp;</font></span><span style=\"font-size: 9pt\"><font face=\"Times New Roman\" color=\"#000000\">&nbsp;</font></span><span style=\"font-size: 9pt\"><font face=\"Times New Roman\" color=\"#000000\">&nbsp;</font></span><span style=\"font-size: 9pt\"><font face=\"Times New Roman\" color=\"#000000\">&nbsp;</font></span> </p><p align=\"center\"><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=89\">Clique aqui para ver as fotos do Projeto!!</a></p><p align=\"center\">_______________________________________________________________________________________</p>', '', '1', '8', '0', '30', '2008-03-27 11:41:19', '68', '', '2008-07-15 15:47:35', '68', '0', '0000-00-00 00:00:00', '2008-03-27 11:31:54', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '15', '0', '7', '', '', '0', '115');
INSERT INTO `#__content` VALUES ('138', 'Projeto Orem Sempre', '', '<h5 align=\"center\"><span class=\"mosimage_caption\"><span style=\"font-family: &#39;Comic Sans MS&#39;\">&quot;... em todas as ora&ccedil;&otilde;es pe&ccedil;am a Deus e sempre orem com o cora&ccedil;&atilde;o agradecido&rdquo;</span><span style=\"font-family: &#39;Comic Sans MS&#39;\">&nbsp;(Filipenses 4:6)</span></span> </h5><div><table border=\"0\" cellpadding=\"0\" width=\"100%\" class=\"MsoNormalTable\" style=\"width: 100%\"><tbody><tr><td style=\"border-right: #ece9d8; padding-right: 0.75pt; border-top: #ece9d8; padding-left: 0.75pt; padding-bottom: 0.75pt; padding-top: 0.75pt; border-bottom: #ece9d8; background-color: transparent; rem_border-left: #ece9d8\"><strong><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">Para refletir:</font></span></strong></td></tr><tr><td style=\"border-right: #ece9d8; padding-right: 0.75pt; border-top: #ece9d8; padding-left: 0.75pt; padding-bottom: 0.75pt; padding-top: 0.75pt; border-bottom: #ece9d8; background-color: transparent; rem_border-left: #ece9d8\"><font size=\"2\" style=\"font-family: &#39;Comic Sans MS&#39;\">As crian&ccedil;as t&ecirc;m uma capacidade muito particular de unir-se a Deus. Por&eacute;m, &eacute; necess&aacute;rio ensinar-lhes a rotina de reservar algum tempo para falar com Ele. Quanto tempo reservamos para atividades e brincadeiras durante o per&iacute;odo de aula? Por que n&atilde;o reservar um momento para a ora&ccedil;&atilde;o do in&iacute;cio das aulas, na hora do lanche e na hora da sa&iacute;da? Al&eacute;m do mais, podemos incentivar &agrave;s crian&ccedil;as a fazer uma ora&ccedil;&atilde;o antes de dormir, com os familiares, no final de semana, por exemplo. Agora &eacute; a hora de ensinar as crian&ccedil;as a orar, come&ccedil;ando por dar-lhes o bom exemplo! O compromisso &eacute; com Deus...</font></td></tr></tbody></table></div><p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\"><strong><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">Diariamente...</font></span></strong></p><div><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&nbsp;</font></span><font size=\"2\"><span style=\"font-family: Symbol\">&middot;<span style=\"font: 7pt &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family: &#39;Comic Sans MS&#39;\">Durante a roda de conversa no in&iacute;cio da aula, haver&aacute; <strong>Ora&ccedil;&atilde;o inicial</strong>, pedindo a Deus uma manh&atilde;/tarde tranq&uuml;ila, de descobertas e aprendizagens, com bom comportamento de todos, obedi&ecirc;ncia, paci&ecirc;ncia... e conforme as necessidades que se percebe na sala...</span></font> </div><p style=\"margin: 0cm 0cm 0pt 18pt; text-indent: -18pt; text-align: justify; tab-stops: list 18.0pt\" class=\"MsoNormal\"><font size=\"2\"><span style=\"font-family: Symbol\">&middot;<span style=\"font: 7pt &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family: &#39;Comic Sans MS&#39;\">Ora&ccedil;&atilde;o antes das refei&ccedil;&otilde;es, para agradecer a Deus o alimento de cada dia.</span></font></p><p style=\"margin: 0cm 0cm 0pt 18pt; text-indent: -18pt; text-align: justify; tab-stops: list 18.0pt\" class=\"MsoNormal\"><font size=\"2\"><span style=\"font-family: Symbol\">&middot;<span style=\"font: 7pt &#39;Times New Roman&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-family: &#39;Comic Sans MS&#39;\">Durante a roda de conversa no final da aula, haver&aacute; <strong>Ora&ccedil;&atilde;o final</strong>, agradecendo pela manh&atilde;/tarde que tiveram.</span></font></p><p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\"><strong><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">Quinzanalmente...</font></span></strong></p><div></div><p style=\"margin: 0cm 0cm 0pt; text-align: justify\" class=\"MsoNormal\"><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">Duas vezes por m&ecirc;s, determinada turma ser&aacute; respons&aacute;vel por uma ora&ccedil;&atilde;o e uma apresenta&ccedil;&atilde;o de hist&oacute;ria que ser&aacute; contada atrav&eacute;s de um teatro, dramatiza&ccedil;&atilde;o, dan&ccedil;a... Sempre utilizando alguma ferramenta de apoio, que chame a aten&ccedil;&atilde;o das crian&ccedil;as. Ficar&aacute; a crit&eacute;rio da turma, desde que seja bastante criativa e que toque, de fato, o cora&ccedil;&atilde;o de quem estiver assistindo.<em> </em></font></span></p><div><em><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&nbsp;</font></span></em><em><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&ldquo;Ponha sua vida nas m&atilde;os do Deus Eterno, confie nele, e ele o ajudar&aacute;.&rdquo; </font></span></em><em><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">Salmo 37:5</font></span></em></div><div></div><div align=\"center\"><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\"><strong><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=90\">Clique&nbsp; aqui para ver as fotos do Projeto!</a></strong></font></span></div><p align=\"center\"><br />______________________________________________________________________________________</p>', '', '1', '8', '0', '30', '2008-03-27 13:54:15', '68', '', '2008-04-10 11:09:41', '68', '0', '0000-00-00 00:00:00', '2008-03-27 13:53:54', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '7', '0', '6', '', '', '0', '81');
INSERT INTO `#__content` VALUES ('139', 'Passeio So Francisco', '', '&nbsp; {mosimage}N<span style=\"language: PT-BR\">o dia 04 de abril,&nbsp;os alunos de 5&ordf; a 8&ordf; s&eacute;rie realizaram um<span>&nbsp; </span>passeio de estudo para S&atilde;o Francisco do Sul. </span><span style=\"language: PT-BR\">A Professora Milena trabalhou<span>&nbsp; </span>conte&uacute;dos explorados em sala de aula nas disciplinas</span> de Ci&ecirc;ncias<span style=\"language: EN\">,</span><span style=\"language: PT-BR\"> Geografia e Hist&oacute;ria,<span>&nbsp; </span>al&eacute;m de um momento de integra&ccedil;&atilde;o com os alunos. <a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=91\">Confira as fotos!</a></span><span style=\"language: EN\">&nbsp;</span><span style=\"language: PT\">&nbsp;</span>', '', '1', '1', '0', '1', '2008-04-09 12:59:08', '68', '', '2008-04-09 13:23:25', '68', '0', '0000-00-00 00:00:00', '2008-04-09 12:56:59', '0000-00-00 00:00:00', 'chmadinha fort.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '14', '', '', '0', '47');
INSERT INTO `#__content` VALUES ('140', 'PROJETO: EU, VOC, NS...', '', '<div class=\"article_seperator\" align=\"justify\" style=\"width: 460px; height: 242px\"><h2 style=\"font-family: &#39;Comic Sans MS&#39;\" align=\"center\"><span class=\"mosimage_caption\"><span style=\"font-family: &#39;Comic Sans MS&#39;\">Per&iacute;odo: 18/02 a 14/03</span><span style=\"font-family: &#39;Comic Sans MS&#39;\">&nbsp;</span> </span></h2><h2 style=\"font-family: &#39;Comic Sans MS&#39;\" align=\"center\"><span style=\"font-family: &#39;Comic Sans MS&#39;\" class=\"mosimage_caption\">&ldquo;Porque foi Deus quem nos fez...&rdquo;</span></h2><h2 style=\"font-family: &#39;Comic Sans MS&#39;\" align=\"center\"><span class=\"mosimage_caption\">&nbsp;<span style=\"font-family: &#39;Comic Sans MS&#39;\">(Ef&eacute;sios 2:10a)</span> </span></h2><h6 style=\"font-family: &#39;Comic Sans MS&#39;\">&ldquo;Eu, voc&ecirc;, n&oacute;s...&quot; partiu do tema da forma&ccedil;&atilde;o da identidade, buscando levar a crian&ccedil;a a perceber-se como indiv&iacute;duo, a situar-se, a aprender a diferenciar seus gostos e opini&otilde;es e, progressivamente, a compreender e respeitar a exist&ecirc;ncia do outro, sempre dentro dos Princ&iacute;pios da Educa&ccedil;&atilde;o Crist&atilde;. <span style=\"font-family: &#39;Comic Sans MS&#39;\">A identidade se molda nos limites das outras refer&ecirc;ncias que nos constituem. Ao mesmo tempo, somos n&oacute;s, mas tamb&eacute;m nossos pais, nossos amigos, nossas experi&ecirc;ncias, ou seja, nos constitu&iacute;mos a partir de nossas rela&ccedil;&otilde;es.</span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><span style=\"font-size: 9pt; font-family: &#39;Comic Sans MS&#39;\"><font color=\"#000000\">A participa&ccedil;&atilde;o de toda fam&iacute;lia nas atividades propostas foi muito importante, pois cada uma p&ocirc;de se envolver ainda mais com as descobertas de seus filhos. </font></span><span style=\"font-size: 9pt\"><font face=\"Times New Roman\" color=\"#000000\">&nbsp;</font></span> <a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=93\">Confira as fotos!!</a></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"> <p style=\"margin: 0cm 0cm 0pt; text-indent: 35.45pt; text-align: justify\" class=\"MsoNormal\" align=\"justify\">&nbsp;</p></span></h6></div><p style=\"font-family: &#39;Comic Sans MS&#39;\" align=\"justify\">&nbsp;</p>', '', '1', '8', '0', '30', '2008-04-09 16:58:12', '68', '', '2008-04-10 11:00:32', '68', '0', '0000-00-00 00:00:00', '2008-04-09 16:55:15', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '16', '0', '5', '', '', '0', '179');
INSERT INTO `#__content` VALUES ('141', 'Dia Do Disfarce...', '', '<p>{mosimage}Os alunos do Jardim 2 da Professora Patr&iacute;cia fizeram muita festa no dia do disfarce....fantasiados passaram por toda a escola, tentando n&atilde;o serem reconhecidos...O objetivo maior desta atividade foi mostrar para as crian&ccedil;as que para Deus n&atilde;o adianta nem disfarce...ele nos conhece at&eacute; fantasiados...<a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=92\">Veja as fotos!!!</a></p><p>&nbsp;</p>', '', '1', '1', '0', '1', '2008-04-09 17:40:21', '68', '', '2008-04-09 17:43:42', '68', '0', '0000-00-00 00:00:00', '2008-04-09 17:34:09', '0000-00-00 00:00:00', 'chamadinha dia do disfarce.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '3', '0', '13', '', '', '0', '132');
INSERT INTO `#__content` VALUES ('142', 'Piquenique  da 1 srie na Sede  de Campo', '', '{mosimage} Com alegria a 1&ordf;s &nbsp;s&eacute;ries das Professoras Daiane e Vanessa &nbsp;exploraram a sua lista de piquenique. Cada aluno teve a sua contribui&ccedil;&atilde;o e o momento da partilha foi na sede de campo...<a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=94\">Confira as fotos!!!</a>', '', '1', '1', '0', '1', '2008-04-10 09:59:32', '68', '', '2008-05-08 14:41:04', '68', '0', '0000-00-00 00:00:00', '2008-04-10 09:55:46', '0000-00-00 00:00:00', 'chamadinha piquenique.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '6', '0', '12', '', '', '0', '187');
INSERT INTO `#__content` VALUES ('143', 'PROJETO: A FAMLIA QUE DEUS ME DEU', '', '<div align=\"center\"><strong class=\"mosimage_caption\"><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">Per&iacute;odo: 24/03 a 11/04</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&nbsp;</font></span></strong></div><div align=\"center\"></div><div align=\"center\"><strong class=\"mosimage_caption\"><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&ldquo;Tenham muitos e muitos filhos; espalhem-se por toda a&nbsp;terra e a </font></span></strong></div><div align=\"center\"></div><div align=\"center\"><strong class=\"mosimage_caption\"><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">dominem.&rdquo;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">(G&ecirc;nesis 1:28)</font></span><em><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font size=\"2\">&nbsp;</font></span></em> </strong></div><p style=\"margin: 0cm 0cm 0pt; text-indent: 35.45pt; text-align: justify\" align=\"center\"><font color=\"#000000\"><span style=\"font-size: 9pt; font-family: &#39;Comic Sans MS&#39;\">Ap&oacute;s criar Ad&atilde;o e Eva, Deus os uniu como marido e mulher, aben&ccedil;oou-os e ent&atilde;o lhes disse: &ldquo;Tenham muitos e muitos filhos; espalhem-se por toda a terra e a dominem.&rdquo; Era prop&oacute;sito de Deus que a Terra fosse povoada com seres criados &agrave; Sua pr&oacute;pria imagem, compondo fam&iacute;lias que trariam gl&oacute;ria a Ele (Isa&iacute;as 45:18).</span><span style=\"font-size: 9pt\"><font face=\"Times New Roman\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</font></span></font></p><p align=\"justify\"><span style=\"font-size: 9pt; font-family: &#39;Comic Sans MS&#39;\"><font color=\"#000000\">A fam&iacute;lia &eacute; o princ&iacute;pio da sociedade. E a fam&iacute;lia crist&atilde; &eacute; aquela em que Deus &eacute; reconhecido como objeto supremo de adora&ccedil;&atilde;o. Ele &eacute; a cabe&ccedil;a, protetor, guia e instrutor de fam&iacute;lias assim. </font></span><span style=\"font-size: 9pt; font-family: &#39;Comic Sans MS&#39;\"><font color=\"#000000\">A fam&iacute;lia tamb&eacute;m &eacute; escola e seus membros s&atilde;o professores e alunos que compartilham conhecimento e aprendem uns com os outros.</font></span><span style=\"font-size: 9pt; font-family: &#39;Comic Sans MS&#39;\"><font color=\"#000000\">A Palavra de Deus deve ser a principal fonte de instru&ccedil;&atilde;o na escola da fam&iacute;lia (Deuteron&ocirc;mio 6:4-9; Salmo 128:1-6).</font></span><span style=\"font-size: 9pt; font-family: &#39;Comic Sans MS&#39;\"><font color=\"#000000\">Este ser&aacute; o momento em que a crian&ccedil;a relatar&aacute; a posi&ccedil;&atilde;o de cada familiar, os acontecimentos marcantes em sua presen&ccedil;a e tamb&eacute;m momentos de lazer, h&aacute;bitos alimentares, prefer&ecirc;ncias, costumes...</font></span></p><p align=\"center\"><span style=\"font-size: 9pt; font-family: &#39;Comic Sans MS&#39;\"><font color=\"#000000\"><a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=99\">Confira as fotos!!</a></font></span></p>', '', '1', '8', '0', '30', '2008-04-10 10:23:55', '68', '', '2008-04-23 10:56:53', '68', '0', '0000-00-00 00:00:00', '2008-04-10 10:22:09', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '10', '0', '4', '', '', '0', '165');
INSERT INTO `#__content` VALUES ('135', 'Formatura Pr-escola 2007', '', '<p>{mosimage}NO dia 12 de Dezembro&nbsp; os alunos da Pr&eacute;-escola ecerraram o ano&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; com muita&nbsp; alegria e v&aacute;rias homenagens.&nbsp; <a href=\"index.php?option=com_zoom&amp;Itemid=99999999&amp;catid=86\">Confira!!!</a></p>', '', '1', '1', '0', '1', '2007-12-21 11:27:46', '68', '', '2007-12-21 12:38:50', '68', '0', '0000-00-00 00:00:00', '2007-12-21 11:23:58', '0000-00-00 00:00:00', 'chamadinha form pre.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '6', '0', '16', '', '', '0', '259');
INSERT INTO `#__content` VALUES ('145', 'PLANETA TERRA: NOSSA CASA', '', '<div align=\"center\"><font face=\"Arial\" size=\"2\"><span style=\"font-weight: bold; font-family: &#39;Comic Sans MS&#39;\">PLANETA TERRA: NOSSA CASA</span></font></div><p style=\"text-align: center\" class=\"MsoNormal\"><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Per&iacute;odo: 12/05 a 13/06</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">&nbsp;</font></span></p><p style=\"text-align: center\" class=\"MsoNormal\"><span style=\"font-style: italic; font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">&ldquo;No come&ccedil;o Deus criou os c&eacute;us e a terra&rdquo;</font></span></p><p style=\"text-align: center\" class=\"MsoNormal\"><span style=\"font-style: italic; font-family: &#39;Comic Sans MS&#39;\"><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><font face=\"Arial\" size=\"2\">(G&ecirc;nesis 1:1)</font></span></p><p style=\"line-height: 49%\" class=\"MsoNormal\"><span style=\"color: black; font-family: &#39;Comic Sans MS&#39;\"></span></p><p style=\"text-align: justify\" class=\"MsoNormal\"><span style=\"color: black; font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Esta semana iniciaremos o projeto &ldquo;Planeta Terra: nossa casa&rdquo; e contaremos a hist&oacute;ria da cria&ccedil;&atilde;o do mundo em partes, durante cinco semanas, explorando os temas a seguir:</font></span></p><p style=\"text-align: justify\" class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Dia e noite </font></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">C&eacute;u<span>&nbsp; </span>e terra </font></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Terra e mar</font></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Frutas/&Aacute;rvores frut&iacute;feras/verduras/ervas...</font></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Dias, meses, anos (calend&aacute;rio, anivers&aacute;rios)</font></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Esta&ccedil;&otilde;es do ano: primavera, ver&atilde;o, outono e inverno</font></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Sol, Lua e estrelas</font></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Seres vivos do mar</font></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Aves</font></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Animais dom&eacute;sticos</font></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Animais selvagens</font></span></p><p class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Animais em extin&ccedil;&atilde;o</font></span></p><p style=\"text-align: justify\" class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Meio ambiente: como j&aacute; sabemos, Deus criou o mundo. Mas o que est&aacute; acontecendo com ele? O que podemos fazer para n&atilde;o destruir o mundo perfeito que Deus criou?</font></span></p><p style=\"margin-left: 7.05pt; text-indent: -7.05pt\" class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span style=\"width: 2.5pt\"><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Polui&ccedil;&atilde;o &ndash; ar, &aacute;gua </font></span></p><p style=\"margin-left: 7.05pt; text-indent: -7.05pt\" class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span style=\"width: 2.5pt\"><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Lixo &ndash; reciclagem </font></span></p><p style=\"margin-left: 7.05pt; text-indent: -7.05pt\" class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span style=\"width: 2.5pt\"><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Queimadas</font></span></p><p style=\"margin-left: 7.05pt; text-indent: -7.05pt\" class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span style=\"width: 2.5pt\"><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"color: black; font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">T&oacute;xicos nos alimentos </font></span></p><p style=\"margin-left: 7.05pt; text-indent: -7.05pt\" class=\"MsoNormal\"><span style=\"font-size: 10pt; color: black; direction: ltr; font-family: Symbol; unicode-bidi: embed\"><font face=\"Arial\" size=\"2\">&middot;</font></span><span style=\"width: 2.5pt\"><font face=\"Arial\" size=\"2\">&nbsp;</font></span><span style=\"color: black; font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Aquecimento global </font></span></p><p style=\"text-align: justify\" class=\"MsoNormal\"><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Dentro deste projeto trabalharemos um dos Sete Princ&iacute;pios Crist&atilde;os: a </font></span><span style=\"font-weight: bold; font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">Mordomia</font></span><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">, que &eacute; </font></span><span style=\"color: black; font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">cuidar das coisas que Deus criou e nos deu. Ele nos confiou a responsabilidade de desfrutar e administrar os recursos naturais. </font></span><span style=\"color: black; font-style: italic; font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">&ldquo;</font></span><span style=\"font-weight: bold; font-style: italic; font-family: &#39;Comic Sans MS&#39;\"><font face=\"Arial\" size=\"2\">E tomou o SENHOR Deus o homem, e o p&ocirc;s no jardim do &Eacute;den para o lavrar e o guardar&rdquo;<span>&nbsp; </span>G&ecirc;nesis 2:15.</font></span></p><p style=\"text-align: justify\" class=\"MsoNormal\"><a href=\"component/option,com_zoom/Itemid,99999999/catid,102/\">Confira as fotos!&nbsp;</a></p><p class=\"MsoNormal\"><span></span></p>', '', '1', '8', '0', '30', '2008-05-29 10:42:43', '68', '', '2008-06-26 15:57:48', '68', '0', '0000-00-00 00:00:00', '2008-05-29 10:41:25', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '3', '0', '2', '', '', '0', '215');
INSERT INTO `#__content` VALUES ('146', 'FESTA DA COLHEITA 2008', '', 'Durante o m&ecirc;s de Junho foi trabalhado com os alunos Exodo 23:16 onde o povo celebrou a colheita dos frutos que haviam semeado...No dia 22 de Junho realizamos a nossa tradicional FESTA&nbsp; n<span style=\"language: PT-BR\">o Centro de Esportes Schulze. Houve </span><span style=\"language: PT-BR\">muitas brincadeiras, pescaria,</span><span style=\"language: PT-BR\"> fogueira,</span><span style=\"language: PT-BR\"> comida, &nbsp;m&uacute;sica e apresenta&ccedil;&atilde;o de dan&ccedil;as e quadrilhas.</span><span style=\"language: PT-BR\"> <a href=\"component/option,com_zoom/Itemid,99999999/catid,105/\">Confira!!!</a></span><span style=\"language: PT\"><a href=\"component/option,com_zoom/Itemid,99999999/catid,105/\">&nbsp;</a></span>', '', '1', '1', '0', '1', '2008-06-27 17:48:19', '68', '', '2008-07-03 15:59:14', '68', '0', '0000-00-00 00:00:00', '2008-06-27 17:27:14', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '2', '0', '11', '', '', '0', '242');
INSERT INTO `#__content` VALUES ('147', 'Orem Sempre', '', '<p align=\"justify\"><font face=\"Comic Sans MS\" size=\"2\">As crian&ccedil;as t&ecirc;m uma capacidade muito particular de unir-se a Deus. Por&eacute;m, &eacute; necess&aacute;rio ensinar-lhes a rotina de reservar algum tempo para falar com Ele. Quanto tempo reservamos para atividades e brincadeiras durante o per&iacute;odo de aula? Por que n&atilde;o reservar um momento para a ora&ccedil;&atilde;o do in&iacute;cio das aulas, na hora do lanche e na hora da sa&iacute;da? Al&eacute;m do mais, podemos incentivar &agrave;s crian&ccedil;as a fazer uma ora&ccedil;&atilde;o antes de dormir, com os familiares, no final de semana, por exemplo. Agora &eacute; a hora de ensinar as crian&ccedil;as a orar, come&ccedil;ando por dar-lhes o bom exemplo! O compromisso &eacute; com Deus...<a href=\"component/option,com_zoom/Itemid,99999999/catid,90/\">Confira as fotos deste Projeto!!!</a></font></p>', '', '1', '1', '0', '1', '2008-07-04 11:34:37', '68', '', '2008-07-04 11:36:16', '68', '0', '0000-00-00 00:00:00', '2008-07-04 11:33:22', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '2', '0', '10', '', '', '0', '154');
INSERT INTO `#__content` VALUES ('148', 'Manh de Autgrafos e Dia de professor na 4 srie', '', 'Os alunos da 4 s&eacute;rie eleitos por melhor texto tiveram&nbsp; direito &agrave; Manh&atilde; de Aut&oacute;grafos...outros atuaram no dia de Professor,&nbsp;onde puderam sentir a responsabilidade&nbsp;que a fun&ccedil;&atilde;o exige. <a href=\"component/option,com_zoom/Itemid,99999999/catid,106/\">Confira as fotos dos Projetos!!</a>&nbsp;', '', '1', '1', '0', '1', '2008-07-04 15:50:16', '68', '', '2008-07-04 15:51:03', '68', '0', '0000-00-00 00:00:00', '2008-07-04 15:39:19', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '2', '0', '9', '', '', '0', '196');
INSERT INTO `#__content` VALUES ('149', 'MINHA CASA  CONSTRUDA NA ROCHA', '', ' <p style=\"margin: 0cm 0cm 0pt; text-align: center\" class=\"MsoNormal\" align=\"center\"><font><strong><span style=\"font-size: 16pt; font-family: &#39;Comic Sans MS&#39;\">MINHA CASA &Eacute; CONSTR&Uacute;IDA NA ROCHA!</span></strong></font></p> <p style=\"margin: 0cm 0cm 0pt; text-align: center\" class=\"MsoNormal\" align=\"center\"><span style=\"font-family: &#39;Comic Sans MS&#39;\"><font>Per&iacute;odo: 23/06 a  11/07</font></span></p><p style=\"margin: 0cm 0cm 0pt; text-align: center\" class=\"MsoNormal\" align=\"center\">&nbsp;</p> <p style=\"margin: 0cm 0cm 0pt; text-align: center\" class=\"MsoNormal\" align=\"center\"><font><em><span style=\"font-family: &#39;Comic Sans MS&#39;\">&nbsp;</span></em></font></p> <p style=\"margin: 0cm 0cm 0pt; text-align: center\" class=\"MsoNormal\" align=\"center\"><font><em><span style=\"font-family: &#39;Comic Sans MS&#39;\">&ldquo;Quem ouve meus ensinamentos e vive de  acordo com eles &eacute; como um homem que constr&oacute;i sua casa na rocha.&rdquo;  </span></em></font></p> <p style=\"margin: 0cm 0cm 0pt; text-align: center\" class=\"MsoNormal\" align=\"center\"><font><em><span style=\"font-family: &#39;Comic Sans MS&#39;\">(1 Samuel 25:6)</span></em></font></p> <p style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\"><font><em><span style=\"font-family: &#39;Comic Sans MS&#39;\">&nbsp;</span></em></font></p> <p style=\"margin: 0cm 0cm 0pt\" class=\"MsoNormal\" align=\"justify\"><font><em><span style=\"font-family: &#39;Comic Sans MS&#39;\"></span></em><span style=\"font-family: &#39;Comic Sans MS&#39;\">A casa constitui o espa&ccedil;o de influ&ecirc;ncia  mais pr&oacute;xima e natural da crian&ccedil;a. Cada casa &eacute; como um reino, onde a crian&ccedil;a  alicer&ccedil;a seu desenvolvimento, onde se sente segura, amada e protegida. Por isso,  a escola parte desta realidade a fim de estabelecer rela&ccedil;&otilde;es educativas, no  intuito de provocar &agrave;s crian&ccedil;as a descobrir novas formas de olhar para aquilo  que j&aacute; conhecem.</span></font></p>', '', '1', '8', '0', '30', '2008-08-18 13:36:28', '68', '', '0000-00-00 00:00:00', '0', '0', '0000-00-00 00:00:00', '2008-08-18 13:34:30', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '1', '0', '1', '', '', '0', '155');
INSERT INTO `#__content` VALUES ('151', 'Encerramento  Juarez Machado 2008', '', 'A Professora Cristiane Brenny no dia 15 de Novembro&nbsp; realizou o musical A Fant&aacute;stica F&aacute;brica de Brinquedos. As modalidades Ballet, Jazz e Patina&ccedil;&atilde;o fizeram parte do evento. <a href=\"component/option,com_zoom/Itemid,99999999/catid,109/\">Confira!!!</a>', '', '1', '1', '0', '1', '2008-12-16 15:40:29', '68', '', '2008-12-16 16:44:58', '68', '0', '0000-00-00 00:00:00', '2008-12-16 15:27:32', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '7', '0', '7', '', '', '0', '26');
INSERT INTO `#__content` VALUES ('152', 'Passeio 6  e 7 Ano Hotel Fazenda Dona Francisca', '', '{mosimage}Os alunos do 6&ordm; e 7&ordm; anos do Fundamental divertiram-se muito neste dia de 01 de Dezembro...apesar das chuvas de todo o m&ecirc;s, os alunos aproveitaram muito o dia onde o sol voltou a brilhar. <a href=\"component/option,com_zoom/Itemid,99999999/catid,110/\">Confira as fotos!!!</a>', '', '1', '1', '0', '1', '2008-12-16 17:46:27', '68', '', '2008-12-17 16:39:23', '68', '0', '0000-00-00 00:00:00', '2008-12-16 17:42:02', '0000-00-00 00:00:00', 'chamada passeio 6 seire.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '6', '0', '6', '', '', '0', '125');
INSERT INTO `#__content` VALUES ('150', 'Feira de Cincias 2008', '', '{mosimage}Nossa Feira este ano foi muito explorada por todos os alunos. Com o Tema: &quot;SUSTENTABILIDADE,&nbsp; uma quest&atilde;o de sobreviv&ecirc;ncia&quot;, aprendemos e ensinamos muito!<a href=\"component/option,com_zoom/Itemid,99999999/catid,108/\"> Confira!!!</a>', '', '1', '1', '0', '1', '2008-11-05 16:22:35', '68', '', '2008-11-07 15:44:31', '68', '0', '0000-00-00 00:00:00', '2008-11-05 16:18:37', '0000-00-00 00:00:00', 'chamadinha.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '5', '0', '8', '', '', '0', '89');
INSERT INTO `#__content` VALUES ('153', 'Formatura 8 srie', '', '{mosimage}No dia 10 de Dezembro aconteceu a Formatura da 8&ordf; s&eacute;rie. Professores, alunos, coordena&ccedil;&otilde;es e familiares compartilharam esta inicial conquista de muitas que ainda vir&atilde;o...A base foi bem edificada, agora basta seguir. Parab&eacute;ns amados alunos!!! <a href=\"component/option,com_zoom/Itemid,99999999/catid,111/\">Confira as fotos!!!</a>', '', '1', '1', '0', '1', '2008-12-17 09:27:10', '68', '', '2008-12-17 09:48:53', '68', '0', '0000-00-00 00:00:00', '2008-12-17 09:23:28', '0000-00-00 00:00:00', 'chamainha.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '5', '', '', '0', '104');
INSERT INTO `#__content` VALUES ('154', 'Formatura Pr-escola 2008', '', '{mosimage}No dia 10 de Dezembro alunos da Pr&eacute;-escola comemoraram a conquista da fase t&atilde;o fascinante que &eacute; a leitura&nbsp;e a escrita...Alunos, professores a familiares participaram da cerim&ocirc;nia. <a href=\"component/option,com_zoom/Itemid,99999999/catid,112/\">Confira as fotos!!!</a>', '', '1', '1', '0', '1', '2008-12-17 09:57:07', '68', '', '2008-12-17 10:20:08', '68', '0', '0000-00-00 00:00:00', '2008-12-17 09:54:22', '0000-00-00 00:00:00', 'chamadinha pre2008.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '4', '', '', '0', '125');
INSERT INTO `#__content` VALUES ('155', 'Encerramento Geral 2008', '', '{mosimage}No dia 11 de Dezembro encerramos o ano com&nbsp; a Festa &nbsp;da Fam&iacute;lia no Recanto da Paz, onde foi servido um delicioso jantar, ap&oacute;s as apresenta&ccedil;&otilde;es realizadas. Este&nbsp; ano o grupo de Teatro da Oficina &nbsp;arrasou com &quot;Um Programa Especial de Natal&quot;.<a href=\"component/option,com_zoom/Itemid,99999999/catid,113/\"> Confira as fotos!!!</a>', '', '1', '1', '0', '1', '2008-12-18 00:52:26', '68', '', '2008-12-18 01:35:11', '68', '0', '0000-00-00 00:00:00', '2008-12-18 00:46:14', '0000-00-00 00:00:00', 'chamada encerramento.jpg', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '2', '0', '3', '', '', '0', '172');
INSERT INTO `#__content` VALUES ('156', ' Confraternizao Famlia Oficina dos Sonhos', '', '<p>Ap&oacute;s um&nbsp; ano de muito trabalho, fechamos o ano com um aben&ccedil;oado almo&ccedil;o no dia 13 Dezembro no Rancho Alegre, &Aacute;guas do Pira&iacute;...Foi um dia de muito sol e harmonia entre as fam&iacute;lias do funcion&aacute;rios...A crian&ccedil;ada curtiu pra valer!!! <a href=\"component/option,com_zoom/Itemid,99999999/catid,115/\">Confira as fotos!!!</a></p>', '', '1', '1', '0', '1', '2008-12-18 10:42:34', '68', '', '2008-12-18 11:45:54', '68', '0', '0000-00-00 00:00:00', '2008-12-18 10:37:18', '0000-00-00 00:00:00', '', '', 'pageclass_sfx=\nback_button=\nitem_title=1\nlink_titles=\nintrotext=1\nsection=0\nsection_link=0\ncategory=0\ncategory_link=0\nrating=\nauthor=\ncreatedate=\nmodifydate=\npdf=\nprint=\nemail=\nkeyref=\ndocbook_type=', '4', '0', '2', '', '', '0', '243');
