INSERT INTO `#__fp_calc` VALUES ('1', 'A', 'win/loose/draw', '1', '1', '1', '1', '1', '1', 'SELECT u.id as player_id,g.* ,pg.id as pg_id, pg.team1_ht AS ht1, pg.team2_ht AS ht2, pg.team1_ft AS ft1, pg.team2_ft AS ft2 FROM #__fp_game as g RIGHT JOIN #__fp_player_game as pg on g.id=pg.game_id RIGHT JOIN #__users as u on u.id=pg.player_id RIGHT JOIN #__fp_player AS p ON p.user_id = pg.player_id WHERE ( (g.team1_ft = g.team2_ft AND pg.team1_ft = pg.team2_ft) OR (g.team1_ft > g.team2_ft AND pg.team1_ft > pg.team2_ft) OR (g.team1_ft < g.team2_ft AND pg.team1_ft < pg.team2_ft) ) AND p.active=1 AND pg.lastupdate IS NOT NULL');
INSERT INTO `#__fp_calc` VALUES ('2', 'B', 'halftime goals home', '1', '1', '1', '1', '3', '1', 'SELECT u.id as player_id,g.* ,pg.id as pg_id, pg.team1_ht AS ht1, pg.team2_ht AS ht2, pg.team1_ft AS ft1, pg.team2_ft AS ft2 FROM #__fp_game as g RIGHT JOIN #__fp_player_game as pg on g.id=pg.game_id RIGHT JOIN #__users as u on u.id=pg.player_id \r\nRIGHT JOIN #__fp_player AS p ON p.user_id = pg.player_id WHERE g.team1_ht = pg.team1_ht and p.active=1  AND pg.lastupdate IS NOT NULL');
INSERT INTO `#__fp_calc` VALUES ('3', 'C', 'halftime goals out', '1', '1', '1', '1', '3', '1', 'SELECT u.id as player_id,g.* ,pg.id as pg_id, pg.team1_ht AS ht1, pg.team2_ht AS ht2, pg.team1_ft AS ft1, pg.team2_ft AS ft2 FROM #__fp_game as g RIGHT JOIN #__fp_player_game as pg on g.id=pg.game_id RIGHT JOIN #__users as u on u.id=pg.player_id RIGHT JOIN #__fp_player AS p ON p.user_id = pg.player_id WHERE g.team2_ht = pg.team2_ht and p.active=1 AND pg.lastupdate IS NOT NULL');
INSERT INTO `#__fp_calc` VALUES ('4', 'D', 'fulltime goals home', '1', '1', '1', '1', '6', '1', 'SELECT u.id as player_id,g.* ,pg.id as pg_id, pg.team1_ht AS ht1, pg.team2_ht AS ht2, pg.team1_ft AS ft1, pg.team2_ft AS ft2 FROM #__fp_game as g RIGHT JOIN #__fp_player_game as pg on g.id=pg.game_id RIGHT JOIN #__users as u on u.id=pg.player_id RIGHT JOIN #__fp_player AS p ON p.user_id = pg.player_id WHERE g.team1_ft = pg.team1_ft and p.active=1  AND pg.lastupdate IS NOT NULL');
INSERT INTO `#__fp_calc` VALUES ('5', 'E', 'fulltime goals out', '1', '1', '1', '1', '6', '1', 'SELECT u.id as player_id,g.* ,pg.id as pg_id, pg.team1_ht AS ht1, pg.team2_ht AS ht2, pg.team1_ft AS ft1, pg.team2_ft AS ft2 FROM #__fp_game as g RIGHT JOIN #__fp_player_game as pg on g.id=pg.game_id RIGHT JOIN #__users as u on u.id=pg.player_id RIGHT JOIN #__fp_player AS p ON p.user_id = pg.player_id WHERE g.team2_ft = pg.team2_ft and p.active=1  AND pg.lastupdate IS NOT NULL');
INSERT INTO `#__fp_calc` VALUES ('6', 'F', 'exact result', '1', '1', '1', '1', '10', '1', 'SELECT u.id as player_id,g.* ,pg.id as pg_id, pg.team1_ht AS ht1, pg.team2_ht AS ht2, pg.team1_ft AS ft1, pg.team2_ft AS ft2 FROM #__fp_game as g RIGHT JOIN #__fp_player_game as pg on g.id=pg.game_id RIGHT JOIN #__users as u on u.id=pg.player_id RIGHT JOIN #__fp_player AS p ON p.user_id = pg.player_id WHERE g.team1_ft = pg.team1_ft AND g.team2_ft = pg.team2_ft and p.active=1  AND pg.lastupdate IS NOT NULL');
INSERT INTO `#__fp_calc` VALUES ('8', 'X', 'Extra questions', '2', '100', '0', '0', '1', '1', 'select pa.* from #__fp_player_answer as pa inner join #__fp_answer as a on pa.answer_id=a.id where correct=1');
INSERT INTO `#__fp_calc` VALUES ('9', 'G', 'Goal difference', '1', '1', '0', '1', '0', '0', 'SELECT u.id as player_id,g.* ,pg.id as pg_id, pg.team1_ht AS ht1, pg.team2_ht AS ht2, pg.team1_ft AS ft1, pg.team2_ft AS ft2 FROM #__fp_game as g RIGHT JOIN #__fp_player_game as pg on g.id=pg.game_id RIGHT JOIN #__users as u on u.id=pg.player_id RIGHT JOIN #__fp_player AS p ON p.user_id = pg.player_id WHERE ((g.team1_ft - g.team2_ft) = (pg.team1_ft\r\n- pg.team2_ft)) AND pg.team1_ft != pg.team2_ft AND (g.team1_ft != pg.team1_ft AND g.team2_ft != pg.team2_ft) AND p.active=1 AND pg.lastupdate IS NOT NULL');
